(4, 'News', 'Donec consectetur sapien nec sem iaculis dignissim', 'donec-consectetur-sapien-nec-sem-iaculis-dignissim', 'https://mls.rosimulator.website/Cdn/images/articles/71461692984812506729857234808594150891140522239179_c4f3cb0a1a856b39fe0a2504c9a3d32d.jpeg', '<p style=\"text-align: justify;\">Nullam a placerat lacus, et luctus metus. Donec venenatis hendrerit tortor, ut dictum turpis feugiat vitae. Praesent lacinia justo ut fermentum fermentum. Nam dictum massa nec sem laoreet blandit. Proin luctus dapibus lobortis. Donec consectetur sapien nec sem iaculis dignissim. Praesent quam libero, lobortis quis rhoncus vel, pulvinar eget nisi. Pellentesque laoreet, ipsum vitae porta pretium, elit nisi euismod mauris, vel dictum elit erat a urna. Sed sagittis urna in dui iaculis posuere. Aenean in imperdiet nisl, sit amet malesuada odio. Curabitur suscipit aliquam mi porta placerat.</p>', 1, 'Eman Olivas', 1713197008);
