INSERT INTO `mls_listings` (`listing_id`, `account_id`, `is_mls`, `is_mls_option`, `is_website`, `featured`, `offer`, `type`, `foreclosed`, `name`, `title`, `tags`, `long_desc`, `category`, `address`, `price`, `reservation`, `payment_details`, `floor_area`, `lot_area`, `unit_area`, `bedroom`, `bathroom`, `parking`, `thumb_img`, `video`, `amenities`, `other_details`, `created_at`, `modified_at`, `status`, `sold_price`, `duration`, `post_score`, `documents`, `display`) VALUES
(2, 1, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'solar-equipped-house-and-lot-for-sale-in-sjdm-city-near-altaraza-mrt7', 'Solar-equipped House and Lot for Sale in SJDM City near Altaraza MRT7', '[\"New\"]', '<p>Give your family the life they deserve??</p>\r\n<p>Bring them to this Eco-friendly Community that builds homes with love of nature. Certified green community by EDGE, an International certification body.</p>\r\n<p>Each property features a spacious 3Bedrooms 2Toilet and Bathrooms Single Attached houses are all equipped with Green Features that help promote conservation in electricity and water consumption while help reduces carbon emissions.</p>\r\n<p>PROPERTY FEATURES</p>\r\n<p>Two-storeys Single-attached Houses</p>\r\n<p>Floor area: 70sqm (minimum)</p>\r\n<p>Lot area: 72sqm (minimum)</p>\r\n<p>Bedrooms: 3</p>\r\n<p>Toilet and Bath: 2</p>\r\n<p>Carport: 1</p>\r\n<p>With spacious Lanai for gardening</p>\r\n<p>Price: Php5.8M</p>\r\n<p>Thru Bank Financing (FREE LOAN PROCESS)</p>\r\n<p>Find out the best house for your family. Take the first step on your journey, contact us and let us guide you.</p>\r\n<p>Mr. Markney Cruz l 09280610725</p>\r\n<p>Licensed Real Estate Broker</p>\r\n<p>PRC REB Lic. No. 33495</p>', 'House and Lot', '{\"barangay\":\"Tungkong Mangga\",\"municipality\":\"City of San Jose Del Monte\",\"province\":\"Bulacan\",\"region\":\"Region III\",\"street\":\"\",\"village\":\"\"}', 5808000, 100000.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 70, 72, 0, 3, 2, 1, 'http://localhost/mls/Cdn/images/listings/56cf0496a629beb81c3d4015d3a15c37.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"Non-Exclusive Authority To Sell\",\"authority_to_sell_expiration\":1714406400,\"com_share\":\"50\"}', 1713344686, 1714910709, 1, 5808000, 1713319501, 4.504, '[\"zack-notebook-label.pdf\",\"Marketing-Plan-Presentation.pdf\"]', 1),
(3, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 1, 'for sale', 'Residential', 0, 'ventura-real-lot-only-in-calamba-laguna-futura-by-filinvest', 'Ventura Real | Lot Only in Calamba, Laguna | Futura by Filinvest', '[\"New\"]', '<div id=\"listing-description\" class=\"Listing-description initialized closed\">\r\n<div class=\"ViewMore-text\">\r\n<div class=\"row collapse\">\r\n<div class=\"ViewMore-text-description\">\r\n<p><strong>Your Green and Healthy First Home</strong></p>\r\n<p>Enjoy the heart of living at Ventura Real, a peaceful community in Calamba, Laguna with a relaxing view of Mt. Makiling. It is ideal for newlyweds wishing to start a family, professionals who want to live closer to their workplace, OFWs longing to provide a home for their loved ones, and investors who want to earn income through rental.</p>\r\n<p>With a name that means &ldquo;royal fortune,&rdquo; it&rsquo;s a home where your family&rsquo;s bright future begins.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Haven for Everyday Bonding</strong></p>\r\n<p>Unwind and bond with loved ones right at the community&rsquo;s healthy amenities:</p>\r\n<ul>\r\n<li>Swimming Pool</li>\r\n<li>Basketball Court</li>\r\n<li>Pavilion</li>\r\n<li>Pocket Parks</li>\r\n<li>Outdoor Play Area with Water</li>\r\n<li>Feature</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>The Heart of Your Locale</strong></p>\r\n<p>Ventura Real is part of the 67-hectare Pueblo Solana, a residential enclave within the 350-hectare Ciudad de Calamba townscape. Located in Brgy. Bubuyan, Calamba, Laguna, Ventura Real enjoys comfortable proximity to Metro Manila. Major roads, transport hubs, and famous tourist destinations, like Tagaytay, are easily within reach.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Landmarks:</strong></p>\r\n<ul>\r\n<li>Filinvest Technology Park &ndash; 4 km</li>\r\n<li>San Jose Hospital &ndash; 6.5 km</li>\r\n<li>Calamba Doctors Hospital &ndash; 9.5 km</li>\r\n<li>New Calamba City Hall &ndash; 11 km</li>\r\n<li>Calamba Medical Center &ndash; 11 km</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>A Well-Planned Community</strong></p>\r\n<p>Established on a 5.4-hectare community, Ventura Real is a carefully-planned community offering modern minimalist inspired homes amidst wide, open spaces.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Your Home Designed with Care</strong></p>\r\n<p>Ventura Real offers a cozy and charming home designed with care.</p>\r\n<p>&nbsp;</p>\r\n<p>HLURB LS No. 32992 | Completion Date: 12/2023</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section id=\"listing-details\" class=\"listing-section details\"></section>', 'Residential Lot', '{\"barangay\":\"Bubuyan\",\"municipality\":\"City of Calamba\",\"province\":\"Laguna\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2576000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 88, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/33b1965d5b5766009c273cfdedc33691.jpeg', NULL, 'Swimming Pool,Basket Ball Court,Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713350498, 1713351366, 1, 2576000, 1713326137, 4.731, NULL, 1),
(4, 1139, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-in-urdaneta-pangasinan-at-camella-urdaneta-77sqm-lot-only', 'Residential Lot in Urdaneta, Pangasinan at Camella Urdaneta | 77sqm Lot Only', '[]', '<p>Camella Urdaneta, the latest Camella house and lot development in Pangasinan, welcomes you to the cleanest, greenest, and safest city in the North! Camella Urdaneta is a 10-hectare Spanish-inspired house and lot development along MacArthur Highway, Barangay Anonas, Urdaneta City, designed to make life comfortable, secure, and convenient.</p>\r\n<p>&nbsp;</p>\r\n<p>Everything is within reach from schools, public markets, malls, churches, hospitals, and restaurants to offices, major transportation hubs, and other establishments.</p>\r\n<p>&nbsp;</p>\r\n<p>Camella Urdaneta offers the ideal affordable home with a wide selection to choose from that will suit your budget and space requirements.</p>\r\n<p>&nbsp;</p>\r\n<p>Around Camella Urdaneta are equally superb tourist destinations like The Minor Basilica of Our Lady of the Most Holy Rosary of Manaoag, Tayug&rsquo;s a-Maze-ing Sunflower Farm, Antong Falls, Lingayen Gulf, Bolinao&rsquo;s Patar Beach, Hundred Islands in Alaminos City, Cabongaoan Beach and Dasol&rsquo;s Tambobong Beach. Travel time to Baguio City has been shortened to 1 hour and 30 minutes considerably with the extension of TPLEX from Urdaneta City to Binalonan and Pozzurubio.</p>\r\n<p>&nbsp;</p>\r\n<p>Camella Urdaneta is bringing you closer to a perfect weekend getaway with your family and friends! Experience cherished traditions, glorious history, and cultures through colorful festivals like Talong Festival, Galicayo Festival, Bangus Festival, Dumayo Festival, Pistay Dayat, Puto Festival, and Patupat Festival.</p>\r\n<p>&nbsp;</p>\r\n<p>Come home to Camella Urdaneta, where life is made easier and enjoyable!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Amenities:</p>\r\n<p>&n