(14, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '2-bedroom-condo-unit-in-paligsahan-quezon-city-at-suntrust-amadea', '2-Bedroom Condo Unit in Paligsahan, Quezon City at Suntrust Amadea', '[\"\"]', '<p>Introducing <strong>Suntrust Amadea</strong>, a magnificent two-tower condominium that redefines modern living in Quezon City. Strategically located in the heart of the country\'s former capital, this development offers unparalleled convenience and a divine ambiance, elevating your lifestyle to new heights. With easy access to thriving business districts, vibrant leisure hubs, and renowned educational institutions, Suntrust Amadea puts you at the center of all the captivating activities the city has to offer.</p>\r\n<p>At Suntrust Amadea, we believe that a home should be more than just a living space&mdash;it should be a sanctuary that provides a haven of relaxation and rejuvenation. Experience the epitome of luxury living with our resort-like amenities and meticulously designed interiors. Immerse yourself in refreshing swimming pools, unwind in lush gardens, stay active in the fitness center, or find solace in tranquil spaces designed for contemplation and meditation. Suntrust Amadea seamlessly blends modern comfort with a serene atmosphere, creating a perfect balance for your well-being.</p>\r\n<p>It&rsquo;s time to discover a new phase in modern living at Suntrust Amadea, where convenience, luxury, and serenity converge to offer you a lifestyle that is truly unmatched.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong></p>\r\n<ul>\r\n<li>Function Hall</li>\r\n<li>Sky Garden</li>\r\n<li>Lap pool</li>\r\n<li>Children\'s Playground</li>\r\n<li>Gazebo/ Multipurpose Hall</li>\r\n<li>Zen Garden</li>\r\n<li>Swimming Pool</li>\r\n<li>Kiddie Pool</li>\r\n<li>Pool Deck</li>\r\n<li>Outdoor Lounge</li>\r\n<li>Fitness Gym</li>\r\n<li>Day care</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>NEARBY ESTABLISHMENTS</strong></p>\r