(26, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'studio-condo-unit-in-diliman-quezon-city-at-suntrust-capitol-plaza', 'Studio Condo Unit in Diliman, Quezon City at Suntrust Capitol Plaza', '[\"\"]', '<p>At <strong>Suntrust Capitol Plaza</strong>, you&rsquo;re surrounded by the vibrancy and vitality of the country&rsquo;s former capital. Set in Diliman, the heart of southern Quezon City, your address lets you live next to the action and redefines how you work and play every single day. Your Home. Your status symbol. The moment you step inside Suntrust Capitol Plaza, you know you&rsquo;ve arrived. Rising 33 stories, your address is set to be one of the tallest residential structures in the city. And it&rsquo;s emerging as a landmark for those who live well. The tower is designed in the 1920s Palazzo style, with a facade enlivened by cornices and corbelled arches. Turn left from the entrance porch to the condominium lobby, where elevators access the homes in two residential wings. Or walk straight to the main lobby, a circular foyer with columns, and a grand, sweeping staircase.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>BUILDING FEATURES</strong></p>\r\n<ul>\r\n<li>Property Management office</li>\r\n<li>24-hour Security</li>\r\n<li>Centralized Mail Area</li>\r\n<li>Retail Shops</li>\r\n<li>Automatic Fire Sprinkler for all units</li>\r\n<li>Emergency Backup power (for selected common areas)</li>\r\n<li>Overhead water tank &amp; underground cistern for ample</li>\r\n<li>water supply</li>\r\n<li>6-Level Podium Parking &amp; 2 Basement Parking</li>\r\n<li>Residential Lobby w/ Reception &amp; Lounge Area</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES/FACILITIES</strong></p>\r\n<ul>\r\n<li>Jacuzzi</li>\r\n<li>Main Pool, Kiddie Pool</li>\r\n<li>Paved Sunbathing Lounge</li>\r\n<li>Pool Deck w/ Sitting Area</li>\r\n<li>Function Rooms</li>\r\n<li>Fitness Gym</li>\r\n<li>Aerobics Room</li>\r\n<li>Massage Room</li>\r\n<li>Sauna</li>\r\n<li>Male &amp; Female Changing &amp; Shower Rooms w/ Toilet</li>\r\n<li>Viewing Deck</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>TYPICAL RESIDENTIAL FEATURES</strong></p>\r\n<ul>\r\n<li>Provision for ACU opening in sleeping area/ bedroom</li>\r\n<li>Provision for telephone line/ cable TV line</li>\r\n<li>Provision for single point water heater at all toilet &amp; baths</li>\r\n<li>Individual electric water submeters</li>\r\n<li>Individual Condominium Certificate of Title</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>GENERAL SPECIFICATIONS</strong></p>\r\n<ul>\r\n<li>Floor Finishes:</li>\r\n</ul>\r\n<p>Ceramic tiles in living, dining, and kitchen, Ceramic Planks in sleeping area/bedroom (1BR/2BR/3BR)</p>\r\n<ul>\r\n<li>Kitchen:</li>\r\n</ul>\r\n<p>Custom-built under-counter kitchen cabinets (overhead cabinets not included)</p>\r\n<p>Kitchen with Mechanical Ventilation</p>\r\n<ul>\r\n<li>Toilet &amp; Bath:</li>\r\n</ul>\r\n<p>Ceramic Tiles</p>\r\n<p>With Mechanical/ Natural Ventilation</p>\r\n<p>&nbsp;</p>\r\n<p><em>Note: The specification, descriptions, plans &amp; visual shown here are intended to give a general idea of the project and are subject to change without prior notice.</em></p>\r\n<p>&nbsp;</p>\r\n<p>HLURB LTS No. 29953</p>\r\n<p>Location: Matalino St., Diliman, Quezon City, Metro Manila</p>\r\n<p>Theme: Contemporary</p>\r\n<p>Total Lot Area: 2,609.00 sqm (28,083.04 sq.ft.)</p>\r\n<p>No. of Tower/s: 1</p>\r\n<p>Estimated Saleable Units: 478 (Residential), 28 (Commercial)</p>', 'Condominium', '{\"barangay\":\"\",\"municipality\":\"Quezon City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 6041364, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 32, 0, 0, 1, 1, 0, 'https://mls.rosimulator.website/Cdn//images/listings/f514f1a4e18649b7c16988e4219