d straight ahead Tanza-Naic Road. Turn Left at Remulla Drive.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Tanza\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2149500, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 108, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/efa0ddef200ec2e25a9d9b2f100b2fea.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713359470, 1713359470, 1, 0, 1713334025, 4.181, NULL, 1),
