(43, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-in-kawit-cavite-the-residences-at-evo-city-564sqm', 'Residential Lot for Sale in Kawit, Cavite | The Residences at Evo City, 564sqm', '[\"\"]', '<p><strong>PRE-SELLING LOT IN CAVITE</strong></p>\r\n<p><strong>The Residences at Evo City</strong>&nbsp;by Alveo Land welcomes with a quiet respite from the hum of a dynamic central business district. Here, spaces for families nurture living environments for closer, intimate bonds, while surrounded by urban conveniences.</p>\r\n<p>Available lots range from approximately 280 to 564 sq.m.</p>\r\n<p>At over 200 hectares, Evo City is a rising business district. The area presents opportunities for residents to unwind, relax, and live dynamically. Evo City is distinctly embraced by nature while providing access to everyday conveniences through its suitable selection of shops and its overall strategic location.</p>\r\n<p>Located in Kawit, Cavite just five kilometers away from the Manila-Cavite Expressway (CAVITEX), Evo City offers the advantage of having efficient access to key Metro Manila cities and other urban areas. Through existing and forthcoming transportation infrastructure developments, Evo City is considered well-positioned and strategically located to become a significant growth center in the region.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong></p>\r\n<ul>\r\n<li>Main Park</li>\r\n<li>Multi-purpose Court</li>\r\n<li>Kids&rsquo; Play Area</li>\r\n<li>Cluster Parks</li>\r\n<li>Swimming Pools</li>\r\n<li>Clubhouse</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>WHAT&rsquo;S NEARBY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Key Hubs/Business Districts</p>\r\n<ul>\r\n<li>EDSA (Ayala Station) (23 km)</li>\r\n<li>Bonifacio Global City (30 km)</li>\r\n<li>Alabang (22 km)</li>\r\n<li>MCX (20 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Location: Brgys. Batong Dalig &amp; Tabon, Kawit, Cavite, Philippines</p>\r\n<p>DHSUD LS No. 034945 (Phase 2)</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Kawit\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 178819000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 564, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/6ed37c4364bc897381c81765bf71d202.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713360102, 1713360102, 1, 0, 1713334700, 4.424, NULL, 1),
(44, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'springfield-view-lot-only-for-sale-in-brgy-sahud-ulan-tanza-cavite-futura-by-filinvest', 'Springfield View | Lot Only for Sale in Brgy. Sahud-Ulan, Tanza, Cavite | Futura by Filinvest', '[\"\"]', '<p><strong>Overview</strong></p>\r\n<p>Discover quality living at its finest here at&nbsp;<strong>Springfield View</strong>, a 22-hectare Mediterranean-inspired community that is designed to give the utmost comfort, privacy, and security for your family.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features and Amenities:</strong></p>\r\n<ul>\r\n<li>Tree Park</li>\r\n<li>Volleyball Court</li>\r\n<li>Gazebo</li>\r\n<li>Picnic Huts</li>\r\n<li>Children&rsquo;s Playground</li>\r\n<li>Privilege at nearby El Sorrento Country Club</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Location</strong></p>\r\n<p>Springfield View is located at Remulla Drive Tanza-Naic Road, Barangay Sahud-Ulan, Tanza, Cavite.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How to get there:</strong></p>\r\n<p>Via South Superhighway &ndash; Take Carmona Exit. Turn right at Governor&rsquo;s Drive. At the Tanza-Trece Martires intersection (landmarks include the Provincial Capitol, and a 7-11 on the left), turn right at the Tanza-Indang Road. Go straight and turn left at A. Soriano Highway or Naic-Tanza Road (landmark is McDonald&rsquo;s on the left). From A. Soriano Highway, turn left at Remulla Drive. The main entrance gate is on the right.</p>\r\n<p>Via Coastal Road &ndash; Upon reaching Brgy. Talaba, turn right going to the Bacoor town proper. Upon reaching Brgy. Mabolo, turn right at Binakayan Road, go straight until Brgy. Sta. Isabel via Kawit Road. Turn left at the Kawit Fire Station leading to the CEPZA Road. Turn left at Remulla Drive. The main entrance gate is on the right.</p>\r\n<p>&nbsp;</p>\r\n<p>HLURB LS No. 12304-R4A-05-03, 12322-R4A-05-02 | Completion Date: 3/1/2006, 2/1/2006</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Tanza\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 3170700, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 185, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/9b3526c580c8077bcd754aaf5150bd7c.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713360249, 1713360249, 1, 0, 1713334918, 4.364, NULL, 1),
