(48, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '2-bedroom-w-balcony-condominium-78sqm-at-mira-in-quezon-city-metro-manila', '2 bedroom w/ Balcony Condominium 78sqm at MIRA in Quezon City, Metro Manila', '[\"\"]', '<div id=\"listing-description\" class=\"Listing-description initialized closed\">\r\n<div class=\"ViewMore-text\">\r\n<div class=\"row collapse\">\r\n<div class=\"ViewMore-text-description\">\r\n<p>Designed by RLC Residences, the award-winning residential division of Robinsons Land Corporation, MIRA is born from a commitment to crafting homes that resonate with the needs and aspirations of residents and their future families. Seamlessly integrating Nordic aesthetics with expansive open spaces, this development sets a new standard for growth-enabling spaces in the city, designed as a family-centric community near key establishments, transport hubs, CBDs, and hospitals.</p>\r\n<p>With productivity upgrades and basic smart home features, MIRA is a future-ready home with more ways to connect, bond, and flourish together in safety and convenience.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>NEARBY AREAS:</strong></p>\r\n<ul>\r\n<li>CBDs:\r\n<ul>\r\n<li>&plusmn; 1.8km Araneta City</li>\r\n<li>&plusmn; 4.3km Eastwood City</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Commercial Establishments:</strong></p>\r\n<ul>\r\n<li>&plusmn; 1km Ali Mall</li>\r\n<li>&plusmn; 1.5km SM City Cubao</li>\r\n<li>&plusmn; 1.5km Farmers Market/Plaza</li>\r\n<li>&plusmn; 1.6km Gateway Mall</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Transportation Hubs:</strong></p>\r\n<ul>\r\n<li>&plusmn; 700m Araneta City Bus Port</li>\r\n<li>&plusmn; 1.5km LRT-2 Cubao</li>\r\n<li>&plusmn; 2.1km MRT-3 Cubao</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Educational Institutions:</strong></p>\r\n<ul>\r\n<li>&plusmn; 750m Technological Institute of the Philippines</li>\r\n<li>&plusmn; 5.2km UP Diliman</li>\r\n<li>&plusmn; 5.5km Ateneo De Manila University</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Medical Establishments:</strong></p>\r\n<ul>\r\n<li>&plusmn; 1.6km World Citi Medical Center</li>\r\n<li>&plusmn; 3.7km Philippine Heart Center</li>\r\n<li>&plusmn; 4.9km St. Luke&rsquo;s Medical Center QC</li>\r\n<li>&plusmn; 5.5km Capitol Medical Center</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Residential Condominiums:</strong></p>\r\n<ul>\r\n<li>245m Escalades East Tower</li>\r\n<li>300m Escalades at the 20th</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong>:</p>\r\n<p>Indoor Amenities:</p>\r\n<ul>\r\n<li>Main Lobby</li>\r\n<li>Fitness Center</li>\r\n<li>MIRA Hall 1</li>\r\n<li>Moon Lounge</li>\r\n<li>Yoga Center</li>\r\n<li>Dance Studio</li>\r\n<li>Clinic</li>\r\n<li>Playscape</li>\r\n<li>Learnscape</li>\r\n<li>Toilet/Shower Area</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Outdoor Amenities:</p>\r\n<ul>\r\n<li>MIRA Square</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Outdoor Play Area</p>\r\n<ul>\r\n<li>Pet Park</li>\r\n<li>Grilling Area</li>\r\n<li>Adult Pool</li>\r\n<li>Kiddie Pool</li>\r\n<li>Leisure Pool</li>\r\n<li>Garden View Deck (RoofDeck)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>DHSUD TLTS#:</p>\r\n<p>NCR-022 (Tower 1 &amp; Podium)</p>\r\n<p>NCR-023 (Tower 2)</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section id=\"listing-details\" class=\"listing-section details\"></section>', 'Condominium', '{\"barangay\":\"San Roque\",\"municipality\":\"Quezon City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 14600000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 78, 0, 0, 2, 2, 0, 'https://mls.rosimulator.website/Cdn//images/listings/37e5104c3c2da8ca83949a0c46ebd3a6.jpeg', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets