(73, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-in-silang-cavite-at-verdea-497sqm', 'Residential Lot for Sale in Silang, Cavite at Verdea | 497sqm', '[\"\"]', '<p><strong>PRE-SELLING LOT IN CAVITE</strong></p>\r\n<p><strong>Verdea&nbsp;</strong>captures an intimate community embraced by green, highlighting the warmth and dynamism of verdant spaces. Spanning close to 25 hectares within an emerging Ayala Land estate, it\'s the quintessential suburban living experience in the South.</p>\r\n<p>Just 55 kilometers from the metro, Verdea, located in Silang, Cavite, is linked through the major thoroughfares of Sta. Rosa-Tagaytay Road, Emilio Aguinaldo Highway, CALAX, and SLEX. The development is within a 1.5-hour drive from Manila, and a mere 15 minutes from Nuvali or Tagaytay where people can enjoy a day at Ayala Malls Solenad, Paseo De Sta. Rosa, and Vista Mall Sta. Rosa. Residents are also conveniently connected to business and educational institutions such as One and Two Evotech, Chiang Kai Shek College - South Forbes, Xavier School - Nuvali, and Everest Academy Laguna Preschool&mdash;making Verdea the perfect dwelling place for the entire family.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Clubhouse</p>\r\n<ul>\r\n<li>Reception Area</li>\r\n<li>Board Room</li>\r\n<li>Function Room</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Swimming Pool</p>\r\n<ul>\r\n<li>Children&rsquo;s Pool</li>\r\n<li>Lap Pool</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Park and Open Spaces</p>\r\n<ul>\r\n<li>Main Park</li>\r\n<li>Basketball Court</li>\r\n<li>Kids&rsquo; Play Area</li>\r\n<li>Jogging Path</li>\r\n<li>Pocket Parks</li>\r\n<li>Linear (Perimeter) Parks</li>\r\n<li>Community Garden</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>WHAT&rsquo;S NEARBY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Key Hubs/Business Districts</p>\r\n<ul>\r\n<li>Nuvali (5.3 km)</li>\r\n<li>Alabang (35.0 km)</li>\r\n<li>Makati (51.3 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Leisure Destinations</p>\r\n<ul>\r\n<li>The Fields NUVALI (5.5 km)</li>\r\n<li>Seda Hotel NUVALI (5.6 km)</li>\r\n<li>Camp N (12.5 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Educational Institutions</p>\r\n<ul>\r\n<li>Chiang Kai Shek College - South Forbes (1.2 km)</li>\r\n<li>Everest Academy Laguna (7.7 km)</li>\r\n<li>Ateneo Graduate School of Business (7.8 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Medical Institutions</p>\r\n<ul>\r\n<li>Qualimed Hospital Sta. Rosa (5.2 km)</li>\r\n<li>The Medical City - South Luzon (8.0 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Location: Hukay Rd., Brgy. Hukay, Silang, Cavite, Philippines</p>\r\n<p>DHSUD Provisional LS No. 905</p>\r\n<p>Completion Date: October 31, 2026</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 26961607, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 497, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/780131ad354b27a82cde76bb3f506102.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713361836, 1713361836, 1, 0, 1713336561, 4.081, NULL, 1),
