(76, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-in-silang-cavite-at-hillside-ridge-278sqm', 'Residential Lot for Sale in Silang, Cavite at Hillside Ridge | 278sqm', '[\"\"]', '<p><strong>PRE-SELLING LOT IN CAVITE</strong></p>\r\n<p>Offering a higher quality of life filled with ease, Hillside Ridge unfolds a 41-hectare, low density subdivision enveloped by refreshing horizons. These Southern upland slopes are masterplanned with a pedestrian-friendly neighborhood that inspire a deeper sense</p>\r\n<p>of community, as well as a safe environment to let kids explore and interact with the wonders of nature.</p>\r\n<p>&nbsp;</p>\r\n<p>Size Range: approx. 278&ndash;652 sq.m.</p>\r\n<p>Price Range as of October 2023 PHP 10,347,321 to 31,934,821</p>\r\n<p>&nbsp;</p>\r\n<p>Just 55 kilometers from the metro, Hillside Ridge, located in Silang, Cavite, is linked through the major thoroughfares of Sta. Rosa-Tagaytay Road, Emilio Aguinaldo Highway, CALAX, and SLEX. The development is within a 1.5-hour drive from Manila, and a mere 15 minutes from Nuvali or Tagaytay where people can enjoy a day at Ayala Malls Solenad, Paseo De Sta. Rosa, and Vista Mall Sta. Rosa. Residents are also conveniently connected to business and educational institutions such as One and Two Evotech, Chiang Kai Shek College - South Forbes, Xavier School - Nuvali, and Everest Academy Laguna Preschool&mdash;making Hillside Ridge the perfect dwelling place for the entire family.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Clubhouse</p>\r\n<ul>\r\n<li>Reception Area</li>\r\n<li>Function Room</li>\r\n<li>Board Room/Meeting Room</li>\r\n<li>Male and Female Restroom</li>\r\n<li>Admin Office</li>\r\n<li>Security</li>\r\n<li>Maintenance Rooms</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Swimming Pool</p>\r\n<ul>\r\n<li>Children&rsquo;s Pool</li>\r\n<li>Infinity/Lap Pool</li>\r\n<li>Lounge Pool</li>\r\n</ul>\r\n<