(77, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '854sqm-residential-lot-for-sale-in-antipolo-rizal-eastland-heights-antipolo---phase-2d-block-1-lot-14', '854sqm Residential Lot for Sale in Antipolo, Rizal | Eastland Heights, Antipolo - Phase 2D, Block 1, Lot 14', '[\"\"]', '<p><strong>1% discount for standard payment term</strong></p>\r\n<p>Eastland Heights, Antipolo - Phase 2D, Block 1, Lot 14</p>\r\n<p>Residential Lot</p>\r\n<p>&nbsp;</p>\r\n<p>Situated around 1,082 feet above sea level,&nbsp;<strong>Eastland Heights</strong>&nbsp;brings together a renowned golf course, exceptional amenities, and top-notch residential properties, all nestled within the harmonious landscapes of Antipolo. This remarkable 5-billion tourism estate is a development by Megaworld\'s Global-Estate Resorts, Inc. (GERI) and stands as Antipolo\'s inaugural township, offering a blend of convenience and a serene way of life with the stunning Sierra Madre mountains as its picturesque setting. In addition to its distinctive attributes, Eastland Heights fosters a community that embraces the principles of eco-therapy, further enhancing its appeal to the luxury market.</p>\r\n<p>&nbsp;</p>\r\n<p>Address: Brgy. Inarawan, Antipolo City, Rizal</p>\r\n<p>HLURB LTS Nos. 32400, 32401, 32402, 32403, 32453, 32397, 32398, 32428, and 32399</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Antipolo\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 25825000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 854, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/a212e2f62fb23c2c7ad3b60545105691.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Mar