(87, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-in-imus-cavite-at-ardia-vermosa-497sqm', 'Residential Lot for Sale in Imus, Cavite at Ardia Vermosa | 497sqm', '[\"\"]', '<p><strong>PRE-SELLING LOT IN CAVITE</strong></p>\r\n<p>Opening the path to holistic living,&nbsp;<strong>Ardia Vermosa</strong>&nbsp;is a residential neighborhood where active and leisure coincide. Enveloped by refreshing open spaces and direct access to vibrant conveniences within the estate, Ardia gives you the freedom to experience life in the whole spectrum.</p>\r\n<p>&nbsp;</p>\r\n<p>Size Range: approx. 293 to 497 sq.m.</p>\r\n<p>Price Range as of October 2023 PHP 15,600,000 to 25,500,000</p>\r\n<p>&nbsp;</p>\r\n<p>Ardia is nestled within the sprawling estate of Vermosa, Ayala Land\'s 700-hectare modern suburban business district spanning Dasmari&ntilde;as and Imus, Cavite. This mixed-use development is accessible via Daang Hari Road and MCX, as well as passageways to Alabang and Las Pi&ntilde;as. Integrating residential lots, commercial establishments, educational institutions, and recreational environments, each component is fit for dynamic lifestyles in the South. Vermosa\'s anchor developments include the Vermosa Sports Hub, De La Salle Zobel - Vermosa Campus, and Ayala Malls Vermosa.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>AMENITIES</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Main Central Park Complex</p>\r\n<ul>\r\n<li>Central Park - Multipurpose field with kid&rsquo;s play area</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Clubhouse</p>\r\n<ul>\r\n<li>Function Room</li>\r\n<li>Boardroom</li>\r\n<li>Shower room</li>\r\n<li>Admin office, staff lounge, security and maintenance rooms</li>\r\n<li>Swimming Pool</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Activity Pocket Parks</p>\r\n<p>Jogging and Biking Trails</p>\r\n<p>&nbsp;</p>\r\n<p>Sports Amenity Park</p>\r\n<ul>\r\n<li>Basketball court</li>\r\n<li>Multi-purpose field</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>FEATURES</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Water</p>\r\n<ul>\r\n<li>Low-flow valves</li>\r\n<li>Dual-flush toilets</li>\r\n<li>Permeable paving on selected areas</li>\r\n<li>Landscaping with native plant species</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Power</p>\r\n<ul>\r\n<li>Natural ventilation</li>\r\n<li>Natural lighting</li>\r\n<li>LED lights</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Air</p>\r\n<ul>\r\n<li>Tree-shaded walkways</li>\r\n<li>Distributed park system</li>\r\n<li>Walkable and bikeable community</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Waste</p>\r\n<ul>\r\n<li>Efficient waste-management system</li>\r\n<li>Materials recovery facility</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>WHAT&rsquo;S NEARBY</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Key Hubs/Business Districts</p>\r\n<ul>\r\n<li>Alabang (16.5 km)</li>\r\n<li>Makati (31.3 km)</li>\r\n<li>Bonifacio Global City (32.2 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Leisure Destinations</p>\r\n<ul>\r\n<li>Vermosa Sports Hub (2.1 km)</li>\r\n<li>Seda Hotel Vermosa (future development) (2.3 km)</li>\r\n<li>Ayala Malls Vermosa (ongoing development) (2.2 km)</li>\r\n<li>The District Dasmarinas (4.4 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Educational Institutions</p>\r\n<ul>\r\n<li>De LaSalle Zobel &ndash; Vermosa (1.9 km)</li>\r\n<li>De LaSalle Santiago Zobel School (12.7 km)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Medical Institutions</p>\r\n<ul>\r\n<li>Qualimed at Vermosa (future development)*</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Location: Vermosa Blvd., Brgy. Pasong Buaya 1, Imus City, Cavite, Philippines</p>\r\n<p>HLURB LS No. 034941 (Phase 3)</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Imus\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 25500000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan