(146, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '3-bedroom-townhouse-at-the-regina-townhouse-in-quezon-city-1713366622', '3 Bedroom Townhouse at The Regina Townhouse in Quezon City', '[\"\"]', '<p>A captivating residence featuring three well-appointed bedrooms, a welcoming foyer, a generously-sized living room, and a practical kitchen alongside a maid\'s utility room. The property includes four fully equipped toilets and baths, complete with fixtures and a luxurious rain shower in the master bath. Additionally, it offers space for two car parks, allowing you to accommodate your preferred choice of the latest vehicle models. Convenient outlets for internet, cable TV, and landline phone are readily available, with the option for a satellite dish provision if desired.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>The Regina Townhouse Features:</strong></p>\r\n<ul>\r\n<li>Provision for CCTV. Cable TV, Telephone and Internet (Fiber Ready).</li>\r\n<li>With CCTV for Common Area and Electronically</li>\r\n<li>Sliding Main Gate with Individual Remote Control.</li>\r\n<li>Intercom (Audio/Video) Phone with Access Control to Pedestrian Gate.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>The Regina Townhouse Location:</strong></p>\r\n<p>Strategically positioned for maximum convenience, you won\'t need to venture far for anything you need. From hospitals and schools to restaurants, commercial establishments, and retail outlets, everything is within easy reach. Malls and financial institutions are just a stone\'s throw away, ensuring accessibility at every turn.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>A new landmark is set to grace AMOR Street within Hilltop Subdivision, Lagro, Quezon City. It aims to establish a community nestled within a tranquil and secure neighborhood characterized by amiable residents.</li>\r\n<li>Conveniently accessible via the main thoroughfares of Commonwealth and Regalado Avenues, traveling to various destinations is effortless, thanks to different modes of public transportation and the forthcoming MRT7.</li>\r\n<li>Private and public educational institutions, places of worship, medical centers, fast-food outlets, dining establishments, home d&eacute;cor stores, and other essentials are conveniently located within a 2-5 kilometer radius.</li>\r\n<li>Moreover, leisure and lifestyle malls such as Ayala Terraces, SM Fairview, and Robinson\'s, along with popular fast-food chains like Jollibee, McDonald\'s, and Burger King, are just a few of the amenities that are easily within reach.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Located in the northern part of Metro Manila, Quezon City is widely regarded as the entertainment hub of the capital. It is home to the country\'s two major television networks, ABS-CBN Corporation and GMA Network, Inc. Due to its vast expanse, the city thrives as an industrial and commercial center.</p>\r\n<p>&nbsp;</p>\r\n<p>DHSUD LS No. 315</p>', 'Townhouse', '{\"barangay\":\"Fairview\",\"municipality\":\"Quezon City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"The Regina Townhouse\"}', 6718000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 109, 53, 0, 3, 2, 0, 'https://mls.rosimulator.website/Cdn//images/listings/e9de0ad0d1fbab47f89a7f76e7981cfd.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713366622, 1713366622, 1, 0, 1713341214, 4.753, NULL, 1),
(148, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'resort-type-residential-property-for-sale-at-gloria-heights-subdivision-antipolo-1713366755', 'Resort-Type Residential Property For Sale at Gloria Heights Subdivision Antipolo', '[\"\"]', '<p><strong>RESIDENTIAL PROPERTY INSIDE GLORIA HEIGHTS SUBDIVISION,</strong></p>\r\n<p><strong>DALIG, ANTIPOLO CITY, RIZAL</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>PROPERTY TYPE: 987 sqm</strong>&nbsp;residential lot with multiple improvements</p>\r\n<p><strong>LOT AREA:</strong>&nbsp;987 square meters</p>\r\n<p><strong>FLOOR AREA:</strong>&nbsp;2-storey house with an approximate size of 350sqm</p>\r\n<p><strong>LOCATION:</strong>&nbsp;Gloria Heights Subdivision, Barangay Dalig, Antipolo City</p>\r\n<p>&nbsp;</p>\r\n<p><strong>PROPERTY FEATURES:</strong></p>\r\n<ul>\r\n<li><strong>A 2-storey big</strong>&nbsp;house converted into two (2) detached units, or restored and reverted back to its original design.</li>\r\n<li>Gloria Heights Subdivision is an \"affluent\" community with nice village amenities.</li>\r\n<li>It is conventiend located around different access doors going to and from: Antipolo proper, Ortigas, Taytay, Marikina, Quezon City, and farther parts of Rizal starting from Teresa.</li>\r\n<li>Churches, schools, malls and other public and private community facilities and institutions are within reach.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>WHY YOU SHOULD BUY THIS PROPERTY:</strong></p>\r\n<ul>\r\n<li>A big estate that may be developed as a family&nbsp;<em>bakasyunan</em>&nbsp;in the future</li>\r\n<li>Income-generating asset - convert / redevelop it into an Airbnb rental, an exclusive resort and events place, popular in Antipolo because of the cool weather</li>\r\n<li>Capitalization opportunities - pocket townhouse developments are flourishing in the village, especially since Gloria Heights is a sought-after address for first time homeowners.</li>\r\n</ul>\r\n<p