(334, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'for-sale-425sqm-lot-near-the-gate-in-manila-southwoods-carmona-cavite-1713433383', 'For Sale 425sqm Lot Near the Gate in Manila Southwoods, Carmona Cavite', '[\"\"]', '<p>Manila Southwoods Lot For Sale Near The Gate</p>\r\n<ul>\r\n<li>Land Area: 425 sqm</li>\r\n<li>Orientation: Southeast</li>\r\n<li>Not perimeter backing and not tumbok</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>This Manila Southwoods Lot for Sale Near the Gate has a land area of 425 sqm and faces southeast. Located at Manila Southwoods Residential Estates (MSRE), this community spans 125 hectares and boasts 2083 upscale residential lots. Initially crafted in 1994 by Fil-Estate Golf and Development, Inc (FEGDI) under the Fil-Estate Group of Companies, it later became part of Global-Estate Resorts Inc (GERI) after a consolidation in December 2010. This residential is also just an 18-min drive to Alabang&rsquo;s commerce center and&nbsp;32-min drive&nbsp;to Makati via Skyway.</p>\r\n<p>Manila Southwoods Golf &amp; Country Club</p>\r\n<p>Manila Southwoods Residential Estates (MSRE) is just beside Southwoods Golf &amp; Country Club, the first Philippine gated community that features two Jack Nicklaus &ldquo;signature&rdquo; championship courses. Aside from its Golf Course, it has a high-end country club which features many amenities:</p>\r\n<p>MASTERS&rsquo; CLUBHOUSE</p>\r\n<p>Reserved solely for members and their invited guests, the Masters&rsquo; Clubhouse at Manila Southwoods offers an ideal setting for unparalleled relaxation. This venue boasts an array of amenities catering to community gatherings, dining, and social engagements, ensuring a diverse range of facilities such as:</p>\r\n<ul>\r\n<li>Reception/Lobby</li>\r\n<li>Veranda Restaurant</li>\r\n<li>Pro Shop</li>\r\n<li>Mulligan Bar</li>\r\n<li>Mulligan Fine Dining</li>\r\n<li>Function Rooms</li>\r\n<li>Locker Rooms</li>\r\n<li>Lockers</li>\r\n<li>Sauna And Steam Bath</li>\r\n<li>Jacuzzi</li>\r\n<li>Shower Rooms</li>\r\n<li>Massage Room</li>\r\n<li>Grooming Area</li>\r\n<li>Safety Deposit Boxes</li>\r\n<li>Parlor Area</li>\r\n<li>Bag Drop</li>\r\n</ul>\r\n<p>LEGENDS&rsquo; CLUBHOUSE</p>\r\n<p>Manila Southwoods presents a secluded retreat from the urban bustle, providing its members and guests with a private atmosphere. The Legends&rsquo; Clubhouse, equipped with high-end amenities, is dedicated to hosting Corporate Tournaments and Professional Events, ensuring a specialized environment to meet your needs.</p>\r\n<p>SPORTS CLUB</p>\r\n<p>Accessible to athletes and sports aficionados alike, Manila Southwoods&rsquo; Sports Club offers an ideal venue for recreational activities and various sporting events. Exclusive usage is granted to Southwoods Residential Estate Homeowners, while Club Members and their accompanied Guests enjoy access to its facilities.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 14747500, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 425, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/f08f5472685a73e560386cac7ba27568.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713433383, 1713433383, 1, 0, 1713408029, 4.057, NULL, 1),
