(394, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'pahara-southwoods-residential-lot-for-sale-in-carmona-cavite-1713445552', 'Pahara Southwoods Residential Lot For Sale in Carmona, Cavite', '[\"\"]', '<p><strong>Pahara Southwoods Lot For Sale</strong></p>\r\n<ul>\r\n<li>LA: 240 sqm</li>\r\n<li>High elevation</li>\r\n<li>Owner open to bank financing</li>\r\n<li>Has title already</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Price: P6,500,000 &nbsp;(27,083/sqm)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>This Pahara Southwoods Lot for Sale is located at Southwoods City. &nbsp;With lot cuts ranging from 238 square meters to 508 square meters, the 601 lot-only units will soon be the home of growing families who seek relaxation in a residential that is close to nature.&nbsp;<em>Pahara</em>, a Bengali term for hills, was named as such due to its location within the slopes and greenscapes of the Manila Golf and Country Club. Pahara will have its own high-end amenities, which includes a swimming pool, a multi-purpose function area and children&rsquo;s playground and gym.</p>\r\n<p>&nbsp;</p>\r\n<p>Aligned with GERI&rsquo;s vision of providing residents with nurturing natural environments, the residential will have a large portion of land to greens and wide open spaces of landscaped pocket parks and jogging paths.</p>\r\n<p>&nbsp;</p>\r\n<p>Southwoods City is the largest and only fully-integrated township with a golf course to rise South of Manila. The township, developed by Megaworld subsidiary Global-Estate Resorts, Inc. (GERI), evokes the LIVE-WORK-PLAY-LEARN lifestyle concept pioneered by Megaworld as it hosts a variety of residential, business, commercial, and leisure components&mdash; including the award-winning developments Southwoods Mall and Southwoods Office Towers.</p>\r\n<p>Surrounded by the 125-hectare Manila Southwoods Golf and Country Club, Southwoods City can be accessed directly from its own exit at the South Luzon Expressway (SLEx).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Establishments at Southwoods City:</strong></p>\r\n<ul>\r\n<li>26-hectare residential village</li>\r\n<li>Themed residential condominiums</li>\r\n<li>Southwoods Mall</li>\r\n<li>Golf course</li>\r\n<li>Office towers</li>\r\n<li>Sto. Ni&ntilde;o de Cebu Parish</li>\r\n<li>Colegio de San Agustin</li>\r\n<li>Transport hub</li>\r\n<li>Medical facility</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Amenties:</strong></p>\r\n<p>Pahara will have its own world-class amenities that compliments that natural surroundings and is suited for any lifestyle.</p>\r\n<ul>\r\n<li>Swimming Pool</li>\r\n<li>Multi-purpose function area</li>\r\n<li>Children&rsquo;s playground</li>\r\n<li>Open Spaces/ Landscaped pocket parks</li>\r\n<li>Aromatic garden</li>\r\n<li>Yoga and Reflexology garden</li>\r\n<li>Color garden</li>\r\n<li>Meditation garden</li>\r\n<li>Jogging Path</li>\r\n<li>Fitness gym</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Other features of Pahara:</strong></p>\r\n<ul>\r\n<li>Gated Entrance</li>\r\n<li>24 &ndash; hour security</li>\r\n<li>Underground Facilities</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6500000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 240, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/467f7faa04858137916af71c1933b03d.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713445552, 1713445552, 1, 0, 1713420273, 3.920, NULL, 1),
