(396, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'ayala-westgrove-heights-lot-for-sale-in-phase-16-silang-cavite-1713445723', 'Ayala Westgrove Heights Lot For Sale in Phase 16, Silang, Cavite', '[\"\"]', '<p><strong>Ayala Westgrove Heights Phase 16, Orchard Point</strong></p>\r\n<p><strong>Ayala Westgrove Heights Vacant Lot for Sale</strong></p>\r\n<ul>\r\n<li>LA: 565sqm</li>\r\n<li>Phase 16 &ndash; Orchard Point</li>\r\n<li>Frontage: 20.15m</li>\r\n<li>Lot is much higher than the road</li>\r\n<li>Elevation: The lot is 169m above mean sea level while the road is only about 165m above mean sea level</li>\r\n<li>Greenview &ndash; The lot has forest views or nature preserve views on at least one side of the property</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Enjoy the continuous fresh mountain breeze you can only get with a lot on a mountain.&nbsp;Ayala Westgrove Heights&nbsp;is a 400-hectare orchard environment located in Silang, Cavite, at the heart of Sta. Rosa, which is a strategic location for families who need everything within their reach. Rooted in the heritage of Ayala Alabang, everyday living in Ayala Westgrove Heights is an extraordinary experience. Developed by Ayala Land Premier and grounded in its commitment to quality, feel secure in a solid investment so you concentrate on what is most vital-giving your children a life of boundless possibilities.</p>\r\n<p>Ayala Westgrove Heights offers lots with sizes ranging from 400 to 1,100 square meters. Completed amenities such as church, pools, clubhouse, central park, sports center and even an actual orchard and mango trees surrounding the area, are in place to make Ayala Westgrove Heights the perfect balance of nature and community to build your future at.</p>\r\n<p>Sheltered from the flurry of city living but minutes away from all that you may need, Ayala Westgrove Heights is at the heart of the flourishing CALABARZON region. You are 5 minutes away from NUVALI, 30 minutes away from Alabang, and less than an hour away from the Makati Central Business District. Access via expansion of South Luzon Expressway through: Mamplasan Exit (with Greenfield sticker), Sta. Rosa Exit or Eton/Malitlit Exit.</p>\r\n<p>The village was strategically designed to take advantage of the natural contour of the land, giving residents varied views which include: Laguna de Bay, Mt. Makiling, Tagaytay Ridge and the Makati Skyline.</p>\r\n<p>Project utilities include an underground conduit provision for power, conduit provision for telephone lines and CATV, Deep wells and water reservoir and a sewage treatment plant. Making this a modern, sustainable community in Silang, Cavite.</p>\r\n<p>Upside PH&nbsp;is your trusted real estate property advisor trusted by clients who found their dream home with us.</p>\r\n<ul>\r\n<li>Turnover Date: Q4 2014</li>\r\n<li>Gross Developable Area: 47.8 hectares</li>\r\n<li>Saleable Area: 10.6 hectares</li>\r\n<li>Total Number of Lots: 211 lots</li>\r\n<li>Percentage of Open Space: 79%</li>\r\n<li>Density Per Hectare: 4 lots per hectare</li>\r\n<li>Elevation: 95-230m above mean sea level</li>\r\n<li>Average Lot Size: 602sqm</li>\r\n<li>Location: Munting Ilog</li>\r\n<li>Terrain: Rolling</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 42375000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 565, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/16a3421a6226ff483050207c85149fc1.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713445723, 1713445723, 1, 0, 1713420358, 3.896, NULL, 1),
(397, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-manila-southwoods-carmona-cavite-1713445819', 'Residential Lot For Sale at Manila Southwoods, Carmona, Cavite', '[\"\"]', '<p>Manila Southwoods Lot For Sale</p>\r\n<ul>\r\n<li>Land Area: 729 sqm</li>\r\n<li>Orientation: Southwest</li>\r\n<li>Elevation: Approx. 74m AMSL</li>\r\n<li>On a nice big and private cul de sac</li>\r\n<li>On a hill and one of the highest in the area</li>\r\n</ul>\r\n<p>This Manila Southwoods Lot for Sale has a lot area of 729 sqm and located in a private cul de sac. Located at Manila Southwoods Residential Estates (MSRE), this community spans 125 hectares and boasts 2083 upscale residential lots. Initially crafted in 1994 by Fil-Estate Golf and Development, Inc (FEGDI) under the Fil-Estate Group of Companies, it later became part of Global-Estate Resorts Inc (GERI) after a consolidation in December 2010. This residential is also just an 18-min drive to Alabang&rsquo;s commerce center and 32-min drive to Makati via Skyway.</p>\r\n<p>Manila Southwoods Golf &amp; Country Club</p>\r\n<p>Manila Southwoods Residential Estates (MSRE) is just beside Southwoods Golf &amp; Country Club, the first Philippine gated community that features two Jack Nicklaus &ldquo;signature&rdquo; championship courses. Aside from its Golf Course, it has a high-end country club which features many amenities:</p>\r\n<p>MASTERS&rsquo; CLUBHOUSE</p>\r\n<p>Reserved solely for members and their invited guests, the Masters&rsquo; Clubhouse at Manila Southwoods offers an ideal setting for unparalleled relaxation. This venue boasts an array of amenities catering to community gatherings, dining, and social engagements, ensuring a diverse range of facilities such as:</p>\r\n<ul>\r\n<li>Reception/Lobby</li>\r\n<li>Veranda Restaurant</li>\r\n<li>Pro Shop</li>\r\n<li>Mulligan Bar</li>\r\n<li>Mulligan Fine Dining</li>\r\n<li>Function Rooms</li>\r\n<li>Locker Rooms</li>\r\n<li>Lockers</li>\r\n<li>Sauna And Steam Bath</li>\r\n<li>Jacuzzi</li>\r\n<li>Shower Rooms</li>\r\n<li>Massage Room</li>\r\n<li>Grooming Area</li>\r\n<li>Safety Deposit Boxes</li>\r\n<li>Parlor Area</li>\r\n<li>Bag Drop</li>\r\n</ul>\r\n<p>LEGENDS&rsquo; CLUBHOUSE</p>\r\n<p>Manila Southwoods presents a secluded retreat from the urban bustle, providing its members and guests with a private atmosphere. The Legends&rsquo; Clubhouse, equipped with high-end amenities, is dedicated to hosting Corporate Tournaments and Professional Events, ensuring a specialized environment to meet your needs.</p>\r\n<p>SPORTS CLUB</p>\r\n<p>Accessible to athletes and sports aficionados alike, Manila Southwoods&rsquo; Sports Club offers an ideal venue for recreational activities and various sporting events. Exclusive usage is granted to Southwoods Residential Estate Homeowners, while Club Members and their accompanied Guests enjoy access to its facilities.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 27702000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 729, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/1dbbd5875f9b32e12cc9a6dec14f8e3d.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713445819, 1713445819, 1, 0, 1713420527, 3.920, NULL, 1),
(398, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'for-sale-239sqm-lot-in-pahara-southwoods-carmona-cavite-1713445905', 'For Sale 239SQM Lot in Pahara Southwoods, Carmona, Cavite', '[\"\"]', '<p>Pahara Southwoods Lot For Sale 239 Sqm</p>\r\n<ul>\r\n<li>Land Area: 239 sqm</li>\r\n<li>Orientation: Southwest</li>\r\n<li>Elevation: Approx. 68m AMSL</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>This Pahara Southwoods Lot For Sale 239 sqm is located inside Southwoods City, the largest and only fully-integrated township in the south. With lot cuts ranging from 238 square meters to 508 square meters, Pahara Southwoods is the ideal place for growing families who seek relaxation in a residential that is close to nature.&nbsp;<em>Pahara</em>, a Bengali term for hills, was named as such due to its location within the slopes and greenscapes of the Manila Golf and Country Club. Pahara has its own high-end amenities, including a swimming pool, a multi-purpose function area, a children&rsquo;s playground, and a gym.</p>\r\n<p>Aligned with GERI&rsquo;s vision of providing residents with nurturing natural environments, the residential will have a large portion of land to greens and wide open spaces of landscaped pocket parks and jogging paths.</p>\r\n<p><strong>About Southwoods City:</strong></p>\r\n<p>Southwoods City&nbsp;is the largest and only fully-integrated township with a golf course to rise South of Manila. The township, developed by Megaworld subsidiary Global-Estate Resorts, Inc. (GERI), evokes the LIVE-WORK-PLAY-LEARN lifestyle concept pioneered by Megaworld as it hosts a variety of residential, business, commercial, and leisure components&mdash; including the award-winning developments Southwoods Mall and Southwoods Office Towers.</p>\r\n<p>Surrounded by the 125-hectare Manila Southwoods Golf and Country Club, Southwoods City can be accessed directly from its own exit at the South Luzon Expressway (SLEX).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Establishments at Southwoods City:</strong></p>\r\n<ul>\r\n<li>26-hectare residential village</li>\r\n<li>Themed residential condominiums</li>\r\n<li>Southwoods Mall</li>\r\n<li>Golf course</li>\r\n<li>Office towers</li>\r\n<li>Sto. Ni&ntilde;o de Cebu Parish</li>\r\n<li>Colegio de San Agustin</li>\r\n<li>Transport hub</li>\r\n<li>Medical facility</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Amenties:</strong></p>\r\n<ul>\r\n<li>Swimming Pool</li>\r\n<li>Multi-purpose function area</li>\r\n<li>Children&rsquo;s playground</li>\r\n<li>Open Spaces/ Landscaped pocket parks</li>\r\n<li>Aromatic garden</li>\r\n<li>Yoga and Reflexology garden</li>\r\n<li>Color garden</li>\r\n<li>Meditation garden</li>\r\n<li>Jogging Path</li>\r\n<li>Fitness gym</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Other features of Pahara:</strong></p>\r\n<ul>\r\n<li>Gated Entrance</li>\r\n<li>24 &ndash; hour security</li>\r\n<li>Underground Facilities</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 5497000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 239, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/d3c0db87dc49a7b8e88dbdbb426d7bbb.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713445905, 1713445905, 1, 0, 1713420623, 3.920, NULL, 1),
