rmation and availability**</p>\r\n<p>&nbsp;</p>\r\n<p>**Strictly for Direct Buyers only, No Agent or Brokers, please.** &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>For a schedule of tripping or Online &nbsp;Presentation, please feel free to contact me now!!</p>\r\n<p>&nbsp;</p>\r\n<p>Contact me now !!&nbsp;</p>\r\n<p>Thank you, Stay safe!</p>\r\n<p>&nbsp;</p>\r\n<p>LOREZA DEXRA ASISTIO</p>\r\n<p>Accredited Salesperson</p>\r\n<p>HLURB # 014650</p>\r\n<p>PRC # 0024171</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 9900000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 415, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/343d5b4f926fee8623983e3d3c275c4b.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713446322, 1713446322, 1, 0, 1713421043, 3.857, NULL, 1);
