(401, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'ayala-westgrove-heights-vacant-lot-near-kidsgrove-for-sale-1713446494', 'Ayala Westgrove Heights Vacant Lot Near Kidsgrove For Sale', '[\"\"]', '<p><strong>Ayala Westgrove Heights Vacant Lot Near Kidsgrove For Sale</strong></p>\r\n<ul>\r\n<li>LA 370 sqm</li>\r\n<li>1-minute walk to Kidsgrove</li>\r\n<li>Regular-shaped Lot</li>\r\n<li>Lot is Elevated and much higher than the road (can build up to 3 floors)</li>\r\n<li>Lot Flat on Top</li>\r\n<li>Along Dalanghita Drive (20-meter wide road)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>PRICE: 20,350,000 (55,000/sqm)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>This Ayala Westgrove Heights vacant lot near Kidsgrove for sale is located in a premier residential community developed by Ayala Land.&nbsp;Situated in Silang, Cavite, the community is surrounded by lush greenery and enjoys a refreshing, cool climate. It is also conveniently located near several key establishments such as schools, hospitals, and commercial centers, making it an ideal place for families to live.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby&nbsp;Schools</strong></p>\r\n<ul>\r\n<li>St. Scholastica&rsquo;s College -Westgrove</li>\r\n<li>DLSU Canlubang</li>\r\n<li>Don Bosco</li>\r\n<li>Brent International School</li>\r\n<li>Ateneo Graduate School</li>\r\n<li>Xavier School</li>\r\n<li>Everest Academy</li>\r\n<li>Miriam College</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Hospitals</strong></p>\r\n<ul>\r\n<li>Asian Hospital</li>\r\n<li>The Medical City South Luzon</li>\r\n<li>Qualimed Nuvali</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Commercial Centers</strong></p>\r\n<ul>\r\n<li>Westborough Town Center</li>\r\n<li>Paseo de Santa Rosa</li>\r\n<li>Alabang Town Center</li>\r\n<li>Solenad 1,2 and 3 Nuvali</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Ayala Westgrove Heights is also known for its commitment to sustainability. It features numerous eco-friendly initiatives, such as a rainwater harvesting system, a recycling program, and a composting program. These initiatives not only help to reduce the community&rsquo;s carbon footprint but also contribute to a healthier and more sustainable environment for residents to enjoy.</p>\r\n<p>One of its most notable features is its sense of community. The community is made up of like-minded individuals who share a love for nature, sustainability, and a healthy lifestyle. The community features numerous events and activities throughout the year, such as fitness classes, sports tournaments, and outdoor movie nights, which provide residents with plenty of opportunities to socialize and connect with their neighbors.</p>\r\n<p>With its emphasis on outdoor living, sustainability, and community, Ayala Westgrove Heights is the perfect place for families to call home. Whether you are looking for a peaceful retreat from the city or a place to raise your family, Ayala Westgrove Heights is definitely worth considering.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Crestwood Park</strong></p>\r\n<p>The 8,000 sqm Crestwood Park is a family grove where you can do whatever brings you closer-an impromptu picnic, a yoga session, or a finger-painting hour.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Orchard Park</strong></p>\r\n<p>Encompassing nearly 7 hectares, Orchard Park South features a blooming Mango Orchard and pathways and lawns for family activities.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Kidsgrove Center</strong></p>\r\n<p>The Kidsgrove center includes a social hall, a children&rsquo;s playground, an interactive wet play area, boardwalks, view decks, a multi-purpose rink, and a junior-sized basketball court.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Church of St. Benedict</strong></p>\r\n<p>The Church of St. Benedict-Westgrove is a place of spiritual comfort for the individual and the community in Ayala Westgrove Heights.</p>\r\n<p>Other amenities include:</p>\r\n<p>Main Clubhouse<br />Sports Center<br />Poolside</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 20350000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 370, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/7baec53f3ce8aa5d2b4e2a2550b262fa.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713446494, 1713446494, 1, 0, 1713421194, 3.920, NULL, 1),
