(403, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'for-sale-281sqm-residential-lot-in-pahara-southwoods-carmona-cavite-1713446685', 'For Sale 281sqm Residential Lot in Pahara Southwoods, Carmona, Cavite', '[\"\"]', '<p>Pahara Southwoods Lots For Sale 281 Sqm</p>\r\n<ul>\r\n<li>Land Area: 281 sqm</li>\r\n<li>Orientation: South</li>\r\n<li>Elevation: Approx. 70m AMSL</li>\r\n<li>Beside the linear park</li>\r\n<li>NOTE: Sale via Deed of Assignment</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>This Pahara Southwoods Lots for Sale 281 sqm is perfect for families who&rsquo;s into outdoor activities such as jogging or morning exercise, since this lot is beside a linear park. Located inside Southwoods City, its the largest and only fully-integrated township in the south. With lot cuts ranging from 238 square meters to 508 square meters, Pahara Southwoods is the ideal place for growing families who seek relaxation in a residential that is close to nature.&nbsp;<em>Pahara</em>, a Bengali term for hills, was named as such due to its location within the slopes and greenscapes of the Manila Golf and Country Club.</p>\r\n<p>&nbsp;</p>\r\n<p>Aligned with GERI&rsquo;s vision of providing residents with nurturing natural environments, the residential will have a large portion of land to greens and wide open spaces of landscaped pocket parks and jogging paths.</p>\r\n<p><strong>About Southwoods City:</strong></p>\r\n<p>Southwoods City&nbsp;is the largest and only fully-integrated township with a golf course to rise South of Manila. The township, developed by Megaworld subsidiary Global-Estate Resorts, Inc. (GERI), evokes the LIVE-WORK-PLAY-LEARN lifestyle concept pioneered by Megaworld as it hosts a variety of residential, business, commercial, and leisure components&mdash; including the award-winning developments Southwoods Mall and Southwoods Office Towers.</p>\r\n<p>Surrounded by the 125-hectare Manila Southwoods Golf and Country Club, Southwoods City can be accessed directly from its own exit at the South Luzon Expressway (SLEX).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Establishments at Southwoods City:</strong></p>\r\n<ul>\r\n<li>26-hectare residential village</li>\r\n<li>Themed residential condominiums</li>\r\n<li>Southwoods Mall</li>\r\n<li>Golf course</li>\r\n<li>Office towers</li>\r\n<li>Sto. Ni&ntilde;o de Cebu Parish</li>\r\n<li>Colegio de San Agustin</li>\r\n<li>Transport hub</li>\r\n<li>Medical facility</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Amenties:</strong></p>\r\n<ul>\r\n<li>Swimming Pool</li>\r\n<li>Multi-purpose function area</li>\r\n<li>Children&rsquo;s playground</li>\r\n<li>Open Spaces/ Landscaped pocket parks</li>\r\n<li>Aromatic garden</li>\r\n<li>Yoga and Reflexology garden</li>\r\n<li>Color garden</li>\r\n<li>Meditation garden</li>\r\n<li>Jogging Path</li>\r\n<li>Fitness gym</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Other features of Pahara:</strong></p>\r\n<ul>\r\n<li>Gated Entrance</li>\r\n<li>24 &ndash; hour security</li>\r\n<li>Underground Facilities</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6182000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 281, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/8b9d506ffdfdba7558bff5b2b95f2225.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713446685, 1713446685, 1, 0, 1713421401, 3.920, NULL, 1),
