(413, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'for-sale-ayala-westgrove-heights-lot-ridge-near-the-clubhouse-in-silang-cavite-1713447630', 'For Sale Ayala Westgrove Heights Lot Ridge near The Clubhouse in Silang Cavite', '[\"\"]', '<p><strong>Ayala Westgrove Heights Lot Ridge Near The Clubhouse</strong></p>\r\n<ul>\r\n<li>Phase 2B Block 9 Lot 11</li>\r\n<li>LA 469sqm</li>\r\n<li>Orientation: Southeast</li>\r\n<li>Frontage: 16.67m</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Price: 25,795,000 (55,000/sqm)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>This Ayala Westgrove Heights Lot ridge near the clubhouse is located at the center of Sta.Rosa area. With its strategic location and a relaxing environment, Ayala Westgrove Heights creates the ideal neighborhood for families.</p>\r\n<p>&nbsp;</p>\r\n<p>The village was strategically designed to take advantage of the natural contour of the land, giving residents varied views which include: Laguna de Bay, Mt. Makiling, Tagaytay Ridge and the Makati Skyline. Project utilities include an underground conduit provision for power, conduit provision for telephone lines and CATV, Deep wells and water reservoir and a sewage treatment plant. Making this a modern, sustainable community in Silang, Cavite.</p>\r\n<p>&nbsp;</p>\r\n<p>Developed by Ayala Land Premier, this residential covers over 400 hectares of prime land area offering choice lots with sizes ranging from 400 to 1,100 square meters. It is also just 5 minutes away from NUVALI, 30 minutes away from Alabang, and less than an hour away from the Makati Central Business District. Access via expansion of South Luzon Expressway through: Mamplasan Exit (with Greenfield sticker), Sta. Rosa Exit or Eton/Malitlit Exit.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Schools</strong></p>\r\n<ul>\r\n<li>St. Scholastica&rsquo;s College -Westgrove</li>\r\n<li>DLSU Canlubang</li>\r\n<li>Don Bosco</li>\r\n<li>Brent International School</li>\r\n<li>Ateneo Graduate School</li>\r\n<li>Xavier School (for future development)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Hospitals</strong></p>\r\n<ul>\r\n<li>Asian Hospital</li>\r\n<li>South Luzon Medical Center</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Commercial Centers</strong></p>\r\n<ul>\r\n<li>Paseo de Santa Rosa</li>\r\n<li>Alabang Town Center</li>\r\n<li>Solana (NUVALI Retail Center)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Crestwood Park</strong></p>\r\n<p>The 8,000-sqm Crestwood Park is a family grove where you can do whatever brings you closer-an impromptu picnic, a yoga session, a finger-painting hour.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Orchard Park</strong></p>\r\n<p>Encompassing nearly 7 hectares, Orchard Park South features a blooming Mango Orchard, as well as pathways and lawns for family activities.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Kidsgrove Center</strong></p>\r\n<p>The kidsgrove center includes a social hall, a children&rsquo;s playground, an interactive wet play area, boardwalks, viewdecks, a multi-purpose rink and a junior sized basketball court.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Church of St. Benedict</strong></p>\r\n<p>The Church of St. Benedict-Westgrove is a place of spiritual comfort for the individual and for the community in Ayala Westgrove Heights.</p>\r\n<p>Other amenities include:</p>\r\n<ul>\r\n<li>Main Clubhouse</li>\r\n<li>Sports Center</li>\r\n<li>Poolside</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 25795000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 469, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/4afc214b4a5739bf84a61d0d4e7ed7b6.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated 