(439, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '300-sqm-residential-lot-for-sale-in-tagaytay-montevista-cavite-1713449687', '300 sqm. Residential Lot For Sale in Tagaytay Montevista, Cavite', '[\"\"]', '<p>Most affordable Lot for sale in Tagaytay City Residential lot for sale inside an exclusive subdivision.- Tagaytay Montevista.Lot Area: 300sqm. (All expenses not included)- clean title, updated real property tax, updated dues- 5 min to Picnic Grove, Tagaytay highlands, Crosswinds, Fiora mall Ayala mall. Property: Mountain view near Swimming pool and clubhouse Brent st.- Lot area: 300 sqm This subdivision boasts of a beautiful mountain view and sloped hills like Baguio City, which in turn makes the whole area, hilly and full of trees that give shade to residents. Remarkably, it\'s along Tagaytay-Calamba road with a very close proximity to Picnic Grove, People\'s Park, Shopping malls, Restaurants, and other commercial establishments; such as banks, hospitals, schools, and other government offices; however as you step inside this cozy subdivision, peace and tranquility welcomes you wide open in the midst of the trees with somewhat like a forest mountain view that envelopes the whole place. Truly, a place you can call home, a second home, or a great investment or vacation rental business. This lot is a must-buy in Tagaytay, with an affordable price compared to other exclusive subdivisions. Below are the amenities you can enjoy here. Amenities:- Swimming pool- Clubhouse- Function hall with a beautiful backdrop of the mountain view- 24-hour security 7 days a week- Children\'s playground- Tennis court- Internet facility for application- Subdivision water tank- Property management office in the Clubhouse.- Maintenance Staff of the subdivision.- Newly opened coffee shop inside the subdivision is Lula Cafe\' Montevista Tagaytay.- Great for Airbnb property investment. ; There are currently 3 or more properties inside the subdivision that are being rented on Airbnb.- Amazing mountain views. Please note that the lot price does not include the monthly subdivision dues for the utilities and maintenance. The current price is P5.50 per square meter. A copy of the Deed of Building/Construction Guidelines and Restrictions is also available if interested. Enjoy Tagaytay living or investing at its finest inside an exclusive subdivision. Please feel free to call or message for any other details. Thank you very much.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 3400000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 300, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/687f8f50e913f1b21217c84fc946ef9e.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713449687, 1713449687, 1, 0, 1713424402, 3.896, NULL, 1),
