(485, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'for-sale-468-sqm-residential-lot-in-ayala-westgrove-heights-1713452946', 'For Sale: 468 SQM Residential Lot in Ayala Westgrove Heights,', '[\"\"]', '<p><strong>For Sale: Ayala Westgrove Heights</strong></p>\r\n<ul>\r\n<li>Phase 15 Block 8 Lot 11</li>\r\n<li>Ridge lot</li>\r\n<li>Single loaded lot</li>\r\n<li>468 sqm</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>30,225,000 negotiable</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 30225000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 468, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/b0c3f70973b7021832594b7b891e4a5c.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713452946, 1713452946, 1, 0, 1713427683, 3.896, NULL, 1),
(486, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-miami-at-south-forbes-in-silang-cavite-1713453025', 'Residential Lot for Sale at Miami at South Forbes in Silang, Cavite', '[\"\"]', '<p>Seamlessly integrating indoor and outdoor spaces, Miami offers garden views and the refreshing breeze, epitomizing modern elegance with a hint of tropical luxury. This resort-inspired community mirrors the ambiance and landscape of Florida, creating a serene oasis for its residents. Characterized by its bright and airy architectural design, which prioritizes natural light and verdant surroundings, Miami embraces the township&rsquo;s distinctive topography and vistas, evoking the luxurious atmosphere of beach resorts. Undoubtedly, this community embodies an idyllic setting to bask in the warm, tropical scenery of Florida.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Miami at South Forbes Amenities:</strong></p>\r\n<ul>\r\n<li>Main Entry Statement</li>\r\n<li>Guard House</li>\r\n<li>Landscape Features</li>\r\n<li>Pocket Parks</li>\r\n<li>Clubhouse/Multi-Purpose Hall</li>\r\n<li>Swimming Pool</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Miami at South Forbes Location:</strong></p>\r\n<p>Nestled within South Forbes Golf City, this residential community draws inspiration from the vibrant culture of Florida. Its charming and tropical ambiance creates a distinctive blend of urban sophistication and natural immersion. Conveniently situated adjacent to CALAX, it seamlessly connects residents to key destinations.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>City of Silang:</strong></p>\r\n<p>Silang\'s economy primarily revolves around agriculture due to its vast land area, with fruit production emerging as its dominant subsector. This surplus produce is distributed and sold not only in Metro Manila but also in neighboring provinces. The town also boasts manufacturing and trade as its other key industries. The Maguyam Industrial Complex and the Daichi Industrial Complex, along with ten other factories beyond its export processing zone, contribute significantly to these sectors. Furthermore, tourism is on the rise in Silang, with attractions such as the National Shrine of Our Lady of La Salette, Gen. Vito L. Belarmino Monument, Riviera Golf and Country Club, and Teofely Nature Farms garnering considerable visitor attention.</p>\r\n<p>&nbsp;</p>\r\n<p>DHSUD LS No.: 19923</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 13123050, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 267, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/ef28f4e938d8cda3617fc79a440d470d.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713453025, 1713453025, 1, 0, 1713427748, 3.858, NULL, 1),
