nas\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2460000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 120, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/ce08d754da950f6e63c99ab7a1fe059a.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713453584, 1713456728, 1, 2460000, 1713431522, 3.857, NULL, 1),
(493, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-alta-monte-in-kaybagal-east-tagaytay-cavite-1713453713', 'Residential Lot for Sale at Alta Monte in Kaybagal East, Tagaytay, Cavite', '[\"\"]', '<div class=\"listing-section listing-description\">\r\n<div class=\"ViewMore-text\">\r\n<div class=\"row\">\r\n<div class=\"ViewMore-text-description\">\r\n<p>Alta Monte stands as the flagship project of Don Tim, comprising 218 generously sized lots ranging from 300 to 600 square meters within a vast 13-hectare village nestled in Tagaytay City. Recognized as the company\'s flagship endeavor, Alta Monte spans across 13 hectares along Magallanes Drive. While providing house and lot units as well as vacant lots, Alta Monte\'s standout feature is Leisure Suites, acclaimed as Tagaytay\'s pioneering medium-rise multi-cluster condominium project.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Alta Monte Amenities:</strong></p>\r\n<p>Nestled in the southern section of the village, Leisure Suites seamlessly merges modern condominium living with the tranquil ambiance of countryside life.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>20-meter Grand Entrance</li>\r\n<li>24/7 Security</li>\r\n<li>Clubhouse</li>\r\n<li>Swimming Pool</li>\r\n<li>Basketball Court</li>\r\n<li>Amphitheater</li>\r\n<li>Children&rsquo;s Playground</li>\r\n<li>Gazebos</li>\r\n<li>Central Park</li>\r\n<li>Community Farm</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Alta Monte Location:</strong></p>\r\n<p>Situated in the southern region of Alta Monte, Leisure Suites stands as Tagaytay\'s inaugural medium-rise multi-cluster condominium project, featuring 10 clusters each housing 6 units. Blending the convenience of urban condominium living with the serene ambiance of the countryside, every unit includes a foyer, living area, dining area, kitchen area, service area, and carport.</p>\r\n<p>&nbsp;</p>\r\n<p>Nearby Establishments:</p>\r\n<ul>\r\n<li>Ayala Malls Serin</li>\r\n<li>Robinsons Tagaytay</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>City of Tagaytay:</strong></p>\r\n<p>As a component city of Cavite, Tagaytay stands as one of the Philippines\' most sought-after tourist spots. Its close proximity to Metro Manila renders it a beloved weekend retreat for denizens of the capital. Elevated at 2,500 feet above sea level amidst mountainous terrain, the city relishes in a delightful average temperature of 24 degrees Celsius. Perched on the ridge of an ancient volcano, Tagaytay boasts a commanding vista of Taal Lake and Volcano.</p>\r\n<p>&nbsp;</p>\r\n<p>LTS # 17719</p>\r\n<p>Reservation fee: Php 20,000</p>\r\n<p>Monthly Downpayment: Php 95, 724</p>\r\n<p>Financing/Payment Terms: Bank</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 7417600, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 152, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/81a753cd7048d0297d4b9cb8759811b8.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713453713, 1713453713, 1, 0, 1713428456, 3.908, NULL, 1),
(494, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'tagaytay-country-homes-2-lot-for-sale-198-sqm-at-13k-per-sqm-1713453779', 'Tagaytay Country Homes 2 Lot For Sale! 198 sqm at 13k per sqm', '[\"\"]', '<p>Tagaytay Country Homes 2</p>\r\n<p>Lot area: 198 sqm</p>\r\n<p>Price: 13,000 per sqm</p>\r\n<p>&nbsp;</p>\r\n<p>CALL Karlo at cel&nbsp;</p>\r\n<ol>\r\n<li>Serene Environment: Tagaytay Country Homes 2 offers a peaceful and tranquil setting, away from the hustle and bustle of the city. The community is surrounded by nature, providing residents with a refreshing and relaxing atmosphere.</li>\r\n<li>Scenic Views: The location of Tagaytay Country Homes 2 offers breathtaking views of the picturesque Taal Volcano and the surrounding mountains. Residents can enjoy stunning sunsets and beautiful landscapes right from their doorstep.</li>\r\n<li>Cool Climate: Tagaytay is known for its cool weather due to its high elevation. Living in Tagaytay Country Homes 2 allows residents to escape the heat and enjoy a more temperate climate throughout the year.</li>\r\n<li>Proximity to Tagaytay City: Tagaytay Country Homes 2 is located close to the popular tourist destination of Tagaytay City. Residents can easily access its attractions, restaurants, recreational activities, and essential amenities within a short drive.</li>\r\n<li>Gated Community: Tagaytay Country Homes 2 is a gated community with 24/7 security, providing a safe and secure environment for residents. This gives homeowners peace of mind and ensures the privacy and well-being of the community.</li>\r\n</ol>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2574000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 198, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/79d990914d32c40a318f9c7ac998f0f1.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713453779, 1713453779, 1, 0, 1713428516, 3.896, NULL, 1),
(495, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'kavanah-prime-residential-lot-for-sale-at-kavanah-palm-residences-1713453853', '(Kavanah Prime) Residential Lot for sale at Kavanah Palm Residences', '[\"\"]', '<p>Kavanah Palm Residences is a unique mixed-use development offering a farm-residential experience with tropical-inspired amenities for the ultimate comfortable living experience. This development by Figtree Properties is only 15 minutes away from Tagaytay City and a few hours from Metro Manila, making it a perfect home for residents who wish to live closer to nature and tourist attractions but have easy access to Metro Manila.</p>\r\n<p>&nbsp;</p>\r\n<p>When you live in Kavanah Palm Residences in Mendez by Figtree Properties, you can enjoy living in a low-density community with plenty of open spaces to move around. The total lot area of this development is 29,717 square meters, and the total number of lots in the area is 103 units.</p>\r\n<p>&nbsp;</p>\r\n<p>Lots for sale in Kavanah Palm Residences come in three variations:</p>\r\n<ul>\r\n<li>Kavanah Midland - 219 square meters</li>\r\n<li>Kavanah Prime - 217 square meters</li>\r\n<li>Kavanah Orchard - 192 square meters</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The good thing about buying houses and lots for sale is the freedom to design your home that fits your needs and wants.</p>\r\n<p>&nbsp;</p>\r\n<p>Kavanah Palm Residences is also home to numerous amenities to ensure the comfort and enjoyment of residents. Here is a list of amenities you can expect to see in Kavanah Palm Residences, Mendez, Cavite:</p>\r\n<ul>\r\n<li>Clubhouse</li>\r\n<li>Infinity pool</li>\r\n<li>Cabanas</li>\r\n<li>Playground</li>\r\n<li>Garden</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The development will also feature commercial lots so residents can access numerous products and services without leaving the development.</p>\r\n<p>&nbsp;</p>\r\n<p>The following is a list of landmarks and establishments near Kavanah Palm Residences:</p>\r\n<p><strong>Schools and Universities near Kavanah Palm Residences:</strong></p>\r\n<ul>\r\n<li>Olivarez College Tagaytay</li>\r\n<li>City College of Tagaytay</li>\r\n<li>Rogationist College</li>\r\n<li>Adventist University of the Philippines</li>\r\n</ul>\r\n<p><strong>Hospitals and Clinics near Kavanah Palm Residences:</strong></p>\r\n<ul>\r\n<li>Tagaytay Medical Center</li>\r\n<li>Ospital ng Tagaytay</li>\r\n<li>Estrella Hospital</li>\r\n<li>De La Salle - Dr. Rodolfo Poblete Memorial Hospital</li>\r\n</ul>\r\n<p><strong>Shopping Centers near Kavanah Palm Residences:</strong></p>\r\n<ul>\r\n<li>Paseo de Amadeo</li>\r\n<li>Robinsons Tagaytay</li>\r\n<li>Pendon Store 1963</li>\r\n<li>Central Mall Bi&ntilde;an</li>\r\n</ul>\r\n<p><strong>Other Subdivisions and Condominiums in Mendez, Cavite:</strong></p>\r\n<ul>\r\n<li>Pueblo del Sol</li>\r\n<li>Cool Suites Residences</li>\r\n<li>SMDC Wind Residences</li>\r\n<li>Pine Suites Tagaytay</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Lots for sale in Kavanah Palm Residences Cavite cost PhP 7,500 to 9,000 per square meter.</p>\r\n<ul>\r\n<li><strong>Kavanah Midland</strong>&nbsp;- PhP 1,642,500 or PhP 7500 per square meter</li>\r\n<li><strong>Kavanah Prime</strong>&nbsp;- PhP 1,953,000 or PhP 9000 per square meter</li>\r\n<li><strong>Kavanah Orchard</strong>&nbsp;- PhP 1,536,000 or PhP 8,000 per square meter</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The down payment to buy a spacious lot for sale in Kavanah Palm Residences is PhP 460,800. Once you have paid the down payment requirement, you can get an in-house loan to finance the purchase of your chosen lot in Kavanah Palm Residences. Assuming that your remaining balance is PhP 1,075,200, your monthly amortization for a 48-month loan term is around PhP 22,400.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Mendez\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 1953000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 217, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/5e0a0bf6a68127f0ab5ac969f768190c.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713453853, 1713453853, 1, 0, 1713428583, 3.896, NULL, 1),
