(502, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-antel-grand-village-grand-meadows-1713454636', 'Residential Lot for sale at Antel Grand Village (Grand Meadows)', '[\"\"]', '<p>The first and only self-contained island community, south of Metro Manila, with more than 140 hectares of carefully planned residential villages, social and commercial districts, and a 1.7- hectare clubhouse, all in the midst of verdant sceneries and breath-taking riverside vistas. AGV Island Community is strategically located between the urban municipalities of Kawit and General Trias, a few minutes away from the booming industrial zone CEZA, and a convenient stop-over on the way to Tagaytay and Batangas through the R-1 diversion road. Live in contemporary modern house models that put the family first in every way, making sure every member feels at home.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Amenities</strong></p>\r\n<p>Headlined by the Clubhouse\'s Water Park, the grandest on this side of Cavite, AGV amenities are specially designed to provide exciting recreation activities for all age groups. With its first-class amenities such as the seven inter-connected pools and sports and wellness facilities, there is no need to step outside of the island.</p>\r\n<p>&nbsp;</p>\r\n<p><em>Water Park Features</em></p>\r\n<ul>\r\n<li>Beach Pool</li>\r\n<li>Massage pool beds</li>\r\n<li>Playground</li>\r\n<li>Activity Game Pool</li>\r\n<li>Party Pool</li>\r\n<li>Lap Pool</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>Clubhouse Features</em></p>\r\n<ul>\r\n<li>Grand Ballroom</li>\r\n<li>Gym</li>\r\n<li>Aerobics Area</li>\r\n<li>Game Room</li>\r\n<li>Coffee Shop</li>\r\n<li>Day Care</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>Village Amenities</em></p>\r\n<ul>\r\n<li>Entrance Gate</li>\r\n<li>Basketball Court</li>\r\n<li>Pocket Parks</li>\r\n<li>Playground</li>\r\n<li>24-Hour Security</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>For families seeking a quieter lifestyle away from the hustle and bustle of Metro Manila, residing just outside the city is an excellent choice. Take, for instance, a house and lot in General Trias, Cavite. This location offers convenient access to amenities while providing the tranquil atmosphere you desire. General Trias, a first-class component city in Cavite, boasts tasteful residential developments, making it an ideal setting for a serene family life.</p>\r\n<p>&nbsp;</p>\r\n<p>Opting for a house and lot in General Trias, Cavite, is a wise decision, especially if you\'re seeking a tranquil and serene lifestyle with your family. With ongoing improvements in road infrastructure, the area boasts easy accessibility to Metro Manila via the South Luzon Expressway. Additionally, weekends offer the flexibility to venture to Tagaytay with convenience.</p>\r\n<p>&nbsp;</p>\r\n<p>HLURB/LTS #0654, #032248, #24606, #24917</p>\r\n<p>Reservation fee: 30,000</p>\r\n<p>Financing/Payment Terms: Bank</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of General Trias\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6105000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 165, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/e16948f3f4eb1ec6f2639b81534488be.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713454636, 1713454636, 1, 0, 1713429369, 3.936, NULL, 1),
