(505, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '104-sqm-residential-lot-for-sale-at-mallorca-villas-in-silang-maguyam-phase-2b-1713454879', '104 sqm Residential lot for Sale at Mallorca Villas in Silang Maguyam (Phase 2B)', '[\"\"]', '<p><strong>About Mallorca Villas</strong></p>\r\n<p>If you want to experience the coziness and vibrance of a Spanish living community in the Philippines, don&rsquo;t miss out on investing in one of the beautiful residential properties offered at Mallorca Villas by Cathay Land, Inc. in Silang, Cavite. You can find this relaxing community perfect for you and your family near SLEX and CALAX. It is the perfect home for modern families, professionals, and retirees.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Key Features of Mallorca Villas</strong></p>\r\n<p>One of the outstanding features of Mallorca Villas is the wide range of house and lot models they offer to property seekers. These include:</p>\r\n<ul>\r\n<li>Casa Cordoba - This is a townhouse model with a living space of 43.32 square meters for end units and 46.26 square meters for middle units.</li>\r\n<li>Duplex - The duplex offers 83.50 square meters of living space and features a porch and a balcony, especially if you love the al fresco experience.</li>\r\n<li>Casa Valencia - This single-attached house and lot have 90.12 square meters of living space. It is perfect for newlyweds and small families, with two bedrooms, a bathroom on the second floor, and a powder room on the ground floor.</li>\r\n<li>Casa Barcelona - Another single-detached home at Mallorca Villas is Casa Barcelona, with 94.94 square meters of living space. Among all the houses and lots in the village, this house and lot model has the most spacious master&rsquo;s bedroom, measuring 15.55 square meters.</li>\r\n<li>Casa Madrid - Casa Madrid&rsquo;s 122.63 square meters of space is perfect for big families. This model has a spacious master&rsquo;s bedroom with an adjoining balcony and two more bedrooms with two bathrooms, a powder room, porch, lanai, and a parking space for two cars.</li>\r\n<li>Lot Only - If you want the freedom to design and build your dream home, consider buying Mallorca Villas&rsquo; lot package. The lot sizes in the village measure 100 square meters, but you may buy more lots if you want to build a bigger house. Take note that your dream home designs are subject to approval and should coincide with the community&rsquo;s theme.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Mallorca Villas Features and Amenities</strong></p>\r\n<p>If you want to live like you&rsquo;re on vacation, Mallorca Villas is your best address. This village has Spain-inspired lifestyle amenities, including a Spanish-Mediterranean designed Club Mallorca clubhouse, swimming pool, basketball court, tennis court, spacious lawn, and parking lot.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Landmarks Around Mallorca Villas</strong></p>\r\n<p>Mallorca Villas by Cathay Land, Inc. is accessible via Governor&rsquo;s Drive, connected to Aguinaldo Highway, South Luzon Expressway Carmona and Southwoods exit. When you liv here, you can quickly access General Mariano Alvarez (GMA), General Trias, Dasmari&ntilde;as, and Tagaytay.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Schools and Universities near Mallorca Villas</strong></p>\r\n<p>Lyceum of the Philippines University - Cavite</p>\r\n<p>Adventist University of the Philippines</p>\r\n<p>De La Salle University - Laguna Campus</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Hospitals and Clinics near Mallorca Villas</strong></p>\r\n<p>Velazco Hospital and Dialysis Clinic</p>\r\n<p>Silang Specialist Medical Center</p>\r\n<p>Asia Medical Family Hospital &amp; Medical Center</p>\r\n<p>San Jose Hospital and Trauma Center</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Shopping Centers near Mallorca Villas</strong></p>\r\n<p>Vista Mall Silang</p>\r\n<p>Sky King</p>\r\n<p>Mini Divisoria Mall</p>\r\n<p>Carolina Mall</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Other Subdivisions and Condominiums in Silang, Cavite</strong></p>\r\n<p>Gaudence Hills Subdivision</p>\r\n<p>Metrogate Silang Estates</p>\r\n<p>Scandia Suites Condominium</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Prices of Properties for Sale in Mallorca Villas</strong></p>\r\n<p>To own a house and lot for sale in Mallorca Villas, a budget of PhP 2,000,000 to PhP 5,500,000 is ideal. If you are interested in paying for it via bank financing, this will cost you around PhP 15,415 to PhP 41,574 per month for a 25-year term at 9.75% per annum. If you are interested in buying a lot for sale in Mallorca Villas, lots here start at PhP 985,000 or PhP 9770 per month in a 10-year term at 8.5% per annum.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Financing Options for Mallorca Villas</strong></p>\r\n<p>You may consider paying for your chosen property in full if you have enough funds. You can also apply for a Pag-IBIG Housing Loan or a bank financial loan. Mallorca Villas&rsquo; monthly amortization rate is based on a 20% down payment-80% bank loan payment option.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2912000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 104, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/f16d649c23dcce44e2b47a07aa2cfa3c.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713454879, 1713454879, 1, 0, 1713429614, 3.908, NULL, 1);
