(506, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'forresta-ultra-luxury-lot-at-vista-land-and-lifescapes-alabang-bacoor-for-sale-1713454967', 'Forresta Ultra Luxury Lot at Vista Land and Lifescapes Alabang, Bacoor For Sale', '[\"\"]', '<p>A carefully planned environment awaits you, where you can relax and unwind amidst a million trees while taking part in exciting challenges that keep you on your toes toward a quest for a balanced and luxurious lifestyle.</p>\r\n<p>&nbsp;</p>\r\n<p>Elevate living experience as Forresta blurs the boundaries between indoors and outdoors, creating an art of extending home into the captivating embrace of sprawling nature.</p>\r\n<p>Step outside and live through the world of boundless luxury at Forresta. A 118-hectare mixed-use development located in Villar City, Alabang.</p>\r\n<p>&nbsp;</p>\r\n<p>It aims to be a lavish &ldquo;city in the forest&rdquo; by seamlessly integrating premium high-rise office towers, luxurious residential condominiums, and ultra-exclusive residential lots within a natural setting.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Prime Location &ndash;</strong>&nbsp;Forresta is part of Vista Land&rsquo;s most expansive CBD in the South, Vista City. With the opening of Muntinlupa-Cavite Expressway (MCX) in 2015, travel time from SLEX to Amore Portofino will be reduced to less than 5 minutes. It&rsquo;s few minutes drive from Makati and Bonifacio BGC via SLEX.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Forresta Ultra Luxury Lot</strong></p>\r\n<p>Lot area: over 1000 square meters| 10,925 sq ft</p>\r\n<p>Orientation: North</p>\r\n<p>Class: Corner Lot</p>\r\n<p>Forresta West &amp; Forresta Grove exclusive lots</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Get in touch with us and schedule for an exclusive tripping and discover your dream home today!</strong></p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Bacoor\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 163415000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 1015, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/b6374c21f6dc000c2fc0cfc94abb985a.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713454967, 1713454967, 1, 0, 1713429682, 3.925, NULL, 1),
