Del Rosario Hospital, Tanza Specialists Medical Center, Naic Doctors Hospital, and Del Rosario Hospital.</p>\r\n<p>Weekend relaxation is a breeze with Tanza\'s array of leisure destinations, such as Las Palmas Beach Resort, Garden Coast Beach, Torres Farm and Resort, and Saddle and Clubs Leisure Park, offering enjoyable escapes for the entire family.</p>\r\n<p>&nbsp;</p>\r\n<p>Reservation fee: 30,000 - 50,000</p>\r\n<p>Financing/Payment Terms: Bank</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Tanza\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2950000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 100, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/a42b90dd0a762a31eb40a948d9522bde.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713455130, 1713455130, 1, 0, 1713429857, 3.908, NULL, 1),
