(510, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '554sqm-residential-lot-for-sale-in-lausanne-crosswinds-tagaytay-city-cavite-1713455257', '554sqm Residential Lot for sale in Lausanne Crosswinds, Tagaytay City, Cavite', '[\"\"]', '<p>Pre-selling lot for sale in Lausanne Crosswinds Tagaytay City Cavite&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Lausanne Block 1 Lot 15</p>\r\n<p>&nbsp;</p>\r\n<p>Lot Only</p>\r\n<p>&nbsp;</p>\r\n<p>Lot Area: 554 square meters</p>\r\n<p>TCP: Php43,612,000</p>\r\n<p>Reservation Fee: Php300,000</p>\r\n<p>&nbsp;</p>\r\n<p>- pre-selling lot (turn-over / buildable next year 2024)</p>\r\n<p>- facing north-east</p>\r\n<p>- overlooking Manila Skyline and Laguna de Bay</p>\r\n<p>&nbsp;</p>\r\n<p>Payment Terms:</p>\r\n<p>- spot cash with discount&nbsp;</p>\r\n<p>- bank financing&nbsp;</p>\r\n<p>&nbsp;</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 43612000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 554, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/85182d1b764133bc34f4414edc8f196e.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713455257, 1713455257, 1, 0, 1713429995, 3.878, NULL, 1),
(511, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-phuket-mansions-in-inchican-cavite-1713455339', 'Residential Lot for Sale at Phuket Mansions in Inchican, Cavite', '[\"\"]', '<p>Experience a glimpse of an Asian oasis within this secluded sanctuary, framed by verdant landscapes and azure skies. Infused with a welcoming Thai ambiance, Phuket Mansions fosters human connection and a profound sense of community in this tranquil retreat. This serene haven, designed to cater to contemporary lifestyles, strikes a harmonious balance between urban living and natural surroundings. From the entrance gate to the living spaces, every detail is meticulously crafted to seamlessly merge with the outdoor environment, instilling a sense of wonder at every turn.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Phuket Mansions Amenities:</strong></p>\r\n<p>Upon entering the main gate, the Main Clubhouse of Phuket Mansions stands as the initial sight to behold. Embodying the elegance of Thai architecture, the Clubhouse features lofty ceilings and a contemporary take on the traditional Thai pitched roof, albeit without ornate embellishments. A white concrete door welcomes guests, inviting them into this uniquely tropical environment. Tall anahaw trees, accompanied by vibrant bougainvilleas, guide residents and visitors towards the clubhouse, crafting a captivating landscape.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Main Entry Statement</li>\r\n<li>Guard House</li>\r\n<li>Landscape Features</li>\r\n<li>Pocket Parks</li>\r\n<li>Clubhouse/Multi-purpose Hall</li>\r\n<li>Swimming Pool</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Phuket Mansions Location:</strong></p>\r\n<p>Just a 5-minute drive from Nuvali, the location offers convenient access to various Central Business Districts including BGC, MOA, Filinvest City, and Makati via SLEX and other major thoroughfares leading northward.</p>\r\n<p>&nbsp;</p>\r\n<p>Nearby Establishments:</p>\r\n<p>Malls</p>\r\n<ul>\r\n<li>Paseo Outlets</li>\r\n<li>Vista Mall Sta. Rosa</li>\r\n<li>Arcadia</li>\r\n<li>Paseo de Santa Rosa</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Hospital and Schools</p>\r\n<ul>\r\n<li>Little Georgia Academy</li>\r\n<li>Saf-school Sto. Domingo Sta. Rosa Laguna</li>\r\n<li>MindChamps International PreSchool</li>\r\n<li>Plica Learning Center</li>\r\n<li>Kids On Board</li>\r\n<li>Montessori Di Ma. Bambinella</li>\r\n<li>Don Jose National High School</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>City of Silang:</strong></p>\r\n<p>Silang\'s economy primarily revolves around agriculture due to its vast land area, with fruit production emerging as its dominant subsector. This surplus produce is distributed and sold not only in Metro Manila but also in neighboring provinces. The town also boasts manufacturing and trade as its other key industries. The Maguyam Industrial Complex and the Daichi Industrial Complex, along with ten other factories beyond its export processing zone, contribute significantly to these sectors. Furthermore, tourism is on the rise in Silang, with attractions such as the National Shrine of Our Lady of La Salette, Gen. Vito L. Belarmino Monument, Riviera Golf and Country Club, and Teofely Nature Farms garnering considerable visitor attention.</p>\r\n<p>&nbsp;</p>\r\n<p>DHSUD LS No.: 16915-R4A-07-03</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 17766400, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 347, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/2c370a271eb96c893bae8d22928cd4d9.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713455339, 1713455339, 1, 0, 1713430075, 3.899, NULL, 1),
