(517, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-la-prairie-in-alfonso-cavite-1713455924', 'Residential Lot for Sale at La Prairie in Alfonso, Cavite', '[\"\"]', '<p>La Prairie Tagaytay, nestled in the misty hills of Tagaytay City, is a tranquil country village spanning 25 hectares. This master-planned subdivision offers residents a serene countryside lifestyle. Situated along the Tagaytay-Nasugbu Highway, it provides a quiet and peaceful neighborhood just one kilometer past the Tagaytay City Radar. Easily accessible, it\'s only a one-hour drive from Manila.</p>\r\n<p>&nbsp;</p>\r\n<p>It\'s an ideal spot for retirement in Tagaytay, an excellent investment opportunity, and the top pick for relishing the cool Tagaytay climate. It offers a wonderful escape from the stresses of work or city life in Manila, providing the perfect setting to bond with your loved ones.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features and Amenities</strong></p>\r\n<ul>\r\n<li>Grand entrance gate</li>\r\n<li>24-hour security service</li>\r\n<li>Perimeter wall</li>\r\n<li>Cemented roads, curbs, and gutters &amp; sidewalks</li>\r\n<li>Underground drainage system</li>\r\n<li>Centralized water system</li>\r\n<li>Meralco electrical supplies</li>\r\n<li>Grass skating area</li>\r\n<li>Open basketball court</li>\r\n<li>Open tennis court</li>\r\n<li>Grand Community Clubhouse</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>NEARBY ESTABLISHMENT</strong></p>\r\n<ul>\r\n<li>Splendito Taal Residential Golf and Country Club</li>\r\n<li>Tagaytay Royale Estates</li>\r\n<li>Sprouts and Spores Organic Farm</li>\r\n<li>Rosemont Gardens</li>\r\n<li>Potter`s Ridge Tagaytay</li>\r\n<li>Ridgewood Heights</li>\r\n<li>Amber Garden Tagaytay</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>When searching for a new residence for you and your family, your primary focus is on the tranquility, comfort, and convenience that the location will offer. A house and lot in Alfonso, Cavite provide precisely that, along with numerous additional benefits. Positioned in close proximity to Batangas, Magallanes, and Tagaytay City, Alfonso, Cavite emerges as a highly promising option for your next significant investment or your next cherished family home.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Alfonso\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6800000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 340, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/2dab435c3e2cac46c809111de4b9c549.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713455924, 1713455924, 1, 0, 1713430631, 3.908, NULL, 1),
