(521, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '308-sqm-residential-lot-for-sale-in-trealva-tagaytay-city-cavite-1713456359', '308 sq.m. Residential Lot For Sale in Trealva, Tagaytay City, Cavite', '[\"\"]', '<p>PRE-SELLING??</p>\r\n<p>Tagaytay Highlands launched a new lot project located at MIDLANDS WEST. Very near in Midlands Clubhouse as well in Madre de Dios. &rdquo;TREALVA&rdquo; the land of extreme beauty offers 360-degree views of the nature from Taal lake to the rugged terrains of Mt. Makiling and Mt. Banahaw.</p>\r\n<p>&nbsp;</p>\r\n<p>??Sizes-274-803sqm</p>\r\n<p>Low density 14.5/ha</p>\r\n<p>??Price- 10M-39M</p>\r\n<p>??Affordable Terms</p>\r\n<p>20% in 36mos</p>\r\n<p>??Optional Membership</p>\r\n<p>?Ze?ro DP up to 60 mos to pay 0% interest</p>\r\n<p>Only 50k to Reserve</p>\r\n<p>&nbsp;</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 10693760, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 308, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/f9bb64db70366e84efc6c8e3fc566a2e.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713456359, 1713456685, 1, 10693760, 1713431480, 3.879, NULL, 1),
(522, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-villas-at-south-forbes-in-inchican-cavite-1713456491', 'Residential Lot for Sale at Villas at South Forbes in Inchican, Cavite', '[\"\"]', '<p>Embodying the timeless elegance of Spanish aesthetics, The Villas radiate with the warmth of sunlit colors and elements of European architecture. Mature trees offer shade along meandering paths that beckon for leisurely walks, while the welcoming open parks encourage family get-togethers and casual conversations among neighbors.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Villas at South Forbes Amenities:</strong></p>\r\n<ul>\r\n<li>Main Entry Statements</li>\r\n<li>Guard House</li>\r\n<li>Landscape Features</li>\r\n<li>Pocket Parks</li>\r\n<li>Children&rsquo;s Playground</li>\r\n<li>Clubhouse/Multi-Purpose Halls</li>\r\n<li>Swimming Pools</li>\r\n<li>Basketball Court</li>\r\n<li>Tennis Court</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Villas at South Forbes Location:</strong></p>\r\n<p>Ideally situated in the Metro Silang-Sta. Rosa-Tagaytay area, known for its business and residential developments, South Forbes spans 500 hectares as a meticulously designed township. It features an array of boutique communities, seamlessly integrating residential, leisure, educational, and sports elements to cater to a sophisticated urban lifestyle.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>City of Silang:</strong></p>\r\n<p>Silang\'s economy primarily revolves around agriculture due to its vast land area, with fruit production emerging as its dominant subsector. This surplus produce is distributed and sold not only in Metro Manila but also in neighboring provinces. The town also boasts manufacturing and trade as its other key industries. The Maguyam Industrial Complex and the Daichi Industrial Complex, along with ten other factories beyond its export processing zone, contribute significantly to these sectors. Furthermore, tourism is on the rise in Silang, with attractions such as the National Shrine of Our Lady of La Salette, Gen. Vito L. Belarmino Monument, Riviera Golf and Country Club, and Teofely Nature Farms garnering considerable visitor attention.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Silang\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 7882500, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 150, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn//images/listings/bde844d23488d77807233dba3738fa9f.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713456491, 1713456491, 1, 0, 1713431232, 3.903, NULL, 1),
