(621, 1145, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '767-sqm-residential-lot-at-suello-village-in-baguio-city-benguet-1713491999', '767 sqm Residential Lot at Suello Village in Baguio City, Benguet', '[\"\"]', '<div id=\"listing-description\" class=\"Listing-description initialized closed\">\r\n<div class=\"ViewMore-text\">\r\n<div class=\"row collapse\">\r\n<div class=\"ViewMore-text-description\">\r\n<p>The property is approximately 4.5 km southwest from Baguio City Hall. It is 300 meters west from Divine Mercy Church and around 370 from Petron Suello Service Station.</p>\r\n<p>The entrance sits on the commercial district fronting the Marcos Highway and is about 200 meters on Terry Court Street, within Suello Village, Barangay Sto Tomas, Res Sec &ldquo;L&rdquo;, Baguio City, Province of Benguet.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Neighborhood Description</strong></p>\r\n<p>The property is located in an area where land development is generally for residential use, characterized by 1 to 2 storey of medium to high cost residential structures.</p>\r\n<p>Generally, the streets in the neighborhood forms a gridiron pattern and are designed to carry light to moderate vehicular and pedestrian traffic loads. Major thoroughfares are either concreteed or asphalt paved with widths ranging from 8.0 meters to 20.0 meters.</p>\r\n<p>Some of the important improvements in the vicinity are as follows:</p>\r\n<ul>\r\n<li>Police Precint 10</li>\r\n<li>Petron Gas Station</li>\r\n<li>Midtown Church of Christ</li>\r\n<li>Executive Express Apartelle</li>\r\n<li>Divine Mercy Church</li>\r\n<li>Pinewoods Golf &amp; Country Club</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Price: Php 20,000 Per sqm</p>\r\n<p>&nbsp;</p>\r\n<p>Lot Property for Sale in Santo Tomas Proper, Baguio, Benguet</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<section id=\"listing-details\" class=\"listing-section details\"></section>', 'Residential Lot', '{\"barangay\":\"Santo