(626, 1146, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'malanday-marikina-house-and-lot-and-a-vacant-lot-for-sale-1713492778', 'Malanday, Marikina House and lot and a vacant lot for Sale', '[\"New\"]', '<p>Malanday, Marikina<br />House and lot and a vacant lot for Sale<br /><br />&bull; 2,000 sqm<br />&bull; 6 bedroom<br />&bull; 7 toilets<br />&bull; No pool<br />&bull; big garden<br />&bull; Clean title<br />&bull; Possible to Build and sell townhouse<br />&bull; Or possible Warehouse<br />&bull; Clean title<br />&bull; No flooding ever</p>\r\n<p><br /><strong>Php 140,000,000 (Nego)</strong></p>\r\n<p>&nbsp;</p>\r\n<p>House Property for Sale in Malanday, Marikina, Metro Manila</p>', 'House and Lot', '{\"barangay\":\"\",\"municipality\":\"Marikina City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 140000000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 2000, 0, 6, 7, 0, 'https://mls.rosimulator.website/Cdn//images/listings/46df5793b0f5b8f602167d0750785877.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713492778, 1713492778, 1, 0, 1713467372, 4.375, NULL, 1),
(627, 1137, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '2-bedroom-mid-rise-condo-unit-for-sale-at-bali-oasis-2-in-santolan-pasig-1713492935', '2 Bedroom Mid-Rise Condo Unit for Sale at Bali Oasis 2 in Santolan, Pasig', '[\"New\"]', '<p><strong>Overview</strong></p>\r\n<p>Escape to tranquility each day at&nbsp;<strong>Bali Oasis</strong>, which is part of Filinvest&rsquo;s growing portfolio of medium-rise condominium enclaves in prime locations.</p>\r\n<p>&nbsp;</p>\r\n<p>Urban dwellers can find a haven in the city at Bali Oasis, a medium-rise condo community along Marcos Highway in Pasig City. Balinese-inspired architectural touches, warm earth tones, and luxuriant landscapes complement the soothing ambiance of this secure, peaceful, yet highly accessible enclave.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features &amp; Amenities:</strong></p>\r\n<ul>\r\n<li>Entry gate and guardhouse</li>\r\n<li>Clubhouse</li>\r\n<li>Children&rsquo;s play areas</li>\r\n<li>Pocket gardens</li>\r\n<li>Music Room</li>\r\n<li>Gym</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Units:</strong></p>\r\n<ul>\r\n<li>Studio Unit</li>\r\n<li>1 Bedroom Unit</li>\r\n<li>2-Bedroom Unit</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Location</strong></p>\r\n<p>Convenience is a way of life as Bali Oasis Phase 2 is just minutes away from everything you will ever need.</p>\r\n<p>Bali Oasis 2 is located at Marcos Highway, Brgy. Santolan, Pasig City.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Places of Interests:</strong></p>\r\n<ul>\r\n<li>Robinsons Metro East &ndash; 1.0 km</li>\r\n<li>Sta. Lucia East Grand Mall &ndash; 1.2 km</li>\r\n<li>SM Marikina &ndash; 2.4 km</li>\r\n<li>Riverbanks Mall &ndash; 2.4 km</li>\r\n<li>Ateneo de Manila University- 2.5 km</li>\r\n<li>Sta. Clara Church &ndash; 3.4 km</li>\r\n<li>Miriam College &ndash; 4.3 km</li>\r\n<li>UP Diliman &ndash; 4.5 km</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Once a rural settlement, Pasig has evolved into one of the 17 cities and municipalities comprising Metro Manila. Previously serving as the capital of Rizal Province before the establishment of the National Capital Region, it has transformed into a vital industrial, residential, and commercial center in the country.</p>\r\n<p>&nbsp;</p>\r\n<p>A significant portion of Pasig encompasses the eastern section of Ortigas Center, a renowned business district housing prominent landmarks such as the historic Meralco Building and the iconic Tektite Towers, constructed in 1993 to accommodate the Philippine Stock Exchange.</p>\r\n<p>&nbsp;</p>\r\n<p>Beyond its bustling business landscape, Pasig boasts cultural and recreational attractions including the Philippine Sports Arena, formerly known as the University of Life Theater and Recreational Area (ULTRA), favored by local athletes for training, and the Immaculate Conception Cathedral, the Philippines\' inaugural Marian Parish.</p>\r\n<p>&nbsp;</p>\r\n<p>HLURB LS Nos. 26936, 26172 | Completion Dates: 03/2014 - 2/2014 - 12/2023</p>\r\n<p>Reservation fee: 20,000</p>\r\n<p>Monthly Downpayment: 58,709.17</p>\r\n<p>Financing/Payment Terms: Bank</p>\r\n<p>Monthly Amortization: 68,233.02</p>', 'Condominium', '{\"barangay\":\"\",\"municipality\":\"Pasig City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 7250200, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 42, 0, 0, 2, 1, 0, 'https://mls.rosimulator.website/Cdn//images/listings/4825871efc23b170f7a97de99b0c99ec.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713492935, 1713492935, 1, 0, 1713467608, 4.343, NULL, 1),
