(742, 1137, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Commercial', 0, 'pasig-4-story-building-near-lg-warehouse-3000-sqm-la-2301-sqm-p-300m-for-sale-1713512255', 'Pasig 4-Story Building near LG Warehouse 3000 sqm LA 2,301 sqm @ P 300M For Sale', '[\"Pre-Owned\"]', '<p>Prime Commercial Building in Pasig - Ideal Investment Opportunity near LG Warehouse!</p>\r\n<p>Description: Discover an exceptional opportunity with this 4-level commercial building in Pasig, conveniently located near the LG warehouse. Spanning a lot area of 2301 sqm and a total floor area of 3000 sqm, this property features provisions to add 2 more levels and an elevator. With a floor-to-ceiling height of 3.2 meters and a spacious parking area at the back, it offers versatility for various purposes. Perfect for office spaces, including medical practices, or residential conversion, this property is an excellent choice for a backroom office. Priced at P300,000,000 plus VAT, it delivers exceptional value for its size and strategic location.</p>\r\n<p>Summary:</p>\r\n<ul>\r\n<li>Property: 4-level commercial building in Pasig (near LG warehouse)</li>\r\n<li>Lot Area: 2301 sqm</li>\r\n<li>Total Floor Area: 3000 sqm</li>\r\n<li>Expansion Potential: Provision to add at least 2 more levels</li>\r\n<li>Elevator Area: Space available for elevator installation</li>\r\n<li>Floor-to-ceiling Height: 3.2 meters</li>\r\n<li>Parking Area: Ample parking space at the back</li>\r\n<li>Usage Options: Ideal for office spaces, including medical practices, or residential conversion</li>\r\n<li>Selling Price: P300,000,000 plus VAT</li>\r\n<li>Rental Rate: P450/sqm + VAT for the entire building</li>\r\n<li>Strategic Location: Walking distance to C. Raymund Pasig</li>\r\n<li>Promising Future Investment Opportunity</li>\r\n</ul>', 'Warehouse', '{\"barangay\":\"\",\"municipality\":\"Pasig City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 300000000, 0.00, '{\