(743, 1137, 0, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 0, 0, 'for sale', 'Commercial', 0, 'lucrative-pasig-income-property-commercial-building-warehouse-tenants-1713512401', 'Lucrative Pasig Income Property: Commercial Building, Warehouse & Tenants', '[\"New\"]', '<p><strong>\"This property is currently inactive but still available\"</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Located on a spacious lot of 9403 sqm, this property is already generating an estimated rental income of P1.8 Million monthly with 18 tenants. And with its prime location in bustling Pasig City, the potential for future growth is endless.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Located along Main road with commercial visibility</li>\r\n<li>Income-generating property for sale in Pasig City</li>\r\n<li>Located on a spacious lot of 9403 sqm</li>\r\n<li>Includes 3 level commercial building improvements and a 2 warehouse structure at the back</li>\r\n<li>fully tenanted property, 18 tenants already in place ( grocery, bank, offices)</li>\r\n<li>Estimated rental income of approximately P1.8 Million monthly</li>\r\n<li>Prime location in a dynamic and growing city</li>\r\n<li>Priced to sell at P1.3 Billion net price to owner</li>\r\n<li>Don\'t miss out on this rare investment opportunity!</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Don\'t miss out on this rare opportunity to invest in a lucrative property in one of Metro Manila\'s most dynamic cities. Contact us today to learn more and schedule a viewing. This property is priced to sell at P1.3 Billion net to owner - don\'t wait, make your move today!</p>', 'Retail Space', '{\"barangay\":\"\",\"municipality\":\"Pasig City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 1400000000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 9403, 0, 0, 0, 0, 'https: