(865, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'overlooking-residential-lot-for-sale-in-sun-valley-estates-golf-club-antipolo-1713533297', 'Overlooking Residential Lot for sale in Sun Valley Estates & Golf Club Antipolo', '[\"\"]', '<p>20-Hole Golf Course Sports Plaza Fishing/Kayak Area</p>\r\n<p>22.5K/sqm Prime Overlooking Lot in Hidden Pond 2 Sun Valley Estates 15% discount Cash Buyers! 24%DP in 6mos Balance payable in 5-10yrs!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sun Valley Antipolo has 4 Clubhouses</strong></p>\r\n<p>You have the Promenade, Pavilion, Village Clubhouse and Sports Plaza Clubhouse. The first two are usually used for events and other social gatherings. The Pavilion even has it\'s own lagoon where Sun Valley residents can fish.</p>\r\n<p>Described as one of the best in the country, Sun Valley has its own 20-Hole golf course inside the subdivision. Set into the beautiful Antipolo landscape, this golf course not only provides easy access to golf for future residents and guests, but also provides amazing views to people who have bought fairway lots.</p>\r\n<p>A place where and your family can play, exercise and enjoy the afternoon sun. It has two playgrounds, a swimming pool, football field, track oval, and even an outdoor gym.</p>\r\n<p>There are multiple lagoons in Sun Valley. The most notable one is called Hidden Pond. A body of water surrounded by beautiful tall trees and mountain views really makes you feel like everything you worked for was worth it.</p>\r\n<p>Current and future developments that will enhance the value of Sunvalley:</p>\r\n<p>C-6 or Metro Manila East Expressway</p>\r\n<p>LRT-2 in year 2020</p>\r\n<p>Continuous road widening</p>\r\n<p>Marikina-Infanta or Marilaque Highway</p>\r\n<p>Future International Seaport in Infanta Quezon</p>\r\n<p>Subway from Airport/Taguig thru Katipunan</p>\r\n<p>Continuos construction/improvement of Antipolo roads</p>\r\n<p>Antipolo as the next big residential Development from Metro Manila</p>\r\n<p>The cost of living in Antipolo is still low compared to neighboring cities plus there is still an abundance of land space. This is why it is a much-needed breather because of the wide expanse of greenery that will welcome any resident after getting out of the metro&rsquo;s heavy traffic and congestion. Making it as your place of residence wouldn&rsquo;t come down as an unworthy investment. In fact, Antipolo residents can attest that although so much has changed in the past years, the place still retained its rural vibe makit it as a perfect sanctuary for those who don&rsquo;t mind the daily commute going to work and come back home to de-stress and relax.</p>', 'Residential Lot', '{\"barangay\":\"Bagong Nayon\",\"municipality\":\"City of Antipolo\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 13815000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 614, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/65d89ffde51c61f8cb14e360d84a2f75.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713533297, 1713533297, 1, 0, 1713507976, 4.362, NULL, 1),
