(881, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-bel-air--anyaya-in-tanza-cavite-south-1713534106', 'Residential Lot for Sale at Bel Air- Anyaya in Tanza, Cavite (South)', '[\"\"]', '<p>This mainly first-class house and lot community development in the heart of Cavite is one of ALH\'s most prestigious horizontal progression. The project is less than a kilometer away from the nearest shore of Manila Bay to the west. In the proud tradition of providing affordable yet high-quality homes to its ever-growing clientele.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bel Air - Anyana - Amenities</strong></p>\r\n<ul>\r\n<li>Clubhouse</li>\r\n<li>Playground</li>\r\n<li>Basketball Court</li>\r\n<li>Guardhouse</li>\r\n<li>Fitness Center</li>\r\n<li>Lounge</li>\r\n<li>Meeting Room</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Bel Air - Anyana - Location</strong></p>\r\n<p>The site is just a few meters away from the tanza-trece martirez road to the east, where it leads you to the city of trece martinez, the capital of cavite. to the southeast of tanza is the city of Dasmarinas, where more prominent schools.</p>\r\n<p>&nbsp;</p>\r\n<p>In Tanza, Cavite, everything you require is within reach, ensuring your family\'s needs are met effortlessly. Commercial hubs in the vicinity, such as Vista Mall Tanza, SM City Tanza, All Home Tanza, SM City Rosario, and Robinsons Place General Trias, cater to your shopping essentials.</p>\r\n<p>&nbsp;</p>\r\n<p>Education is paramount, and Tanza boasts reputable schools, including Tanza National Comprehensive High School, Tanza National Trade School, Saint Augustine School Tanza, Good Tree International School, and Holy Trinity School of Tanza, guaranteeing your children receive quality education.</p>\r\n<p>&nbsp;</p>\r\n<p>Healthcare emergencies are swiftly addressed with numerous hospitals nearby, including Tanza Family General Hospital and Pharmacy, Tanza Doctors Hospital, Del Rosario Hospital, Tanza Specialists Medical Center, Naic Doctors Hospital, and Del Rosario Hospital.</p>\r\n<p>Weekend relaxation is a breeze with Tanza\'s array of leisure destinations, such as Las Palmas Beach Resort, Garden Coast Beach, Torres Farm and Resort, and Saddle and Clubs Leisure Park, offering enjoyable escapes for the entire family.</p>\r\n<p>&nbsp;</p>\r\n<p>Reservation fee: 30,000 - 50,000</p>\r\n<p>Financing/Payment Terms: Bank</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Tanza\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 3213000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 105, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/e7770b5b9e1450c6147d493ad17283af.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713534106, 1713534106, 1, 0, 1713508848, 3.908, NULL, 1),
