(883, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-amiya-raya-in-san-mateo-rizal-1713534246', 'Residential Lot for sale at Amiya Raya in San Mateo, Rizal', '[\"\"]', '<p>Imagine a place where spending precious time with the family is not reserved exclusively for long weekends or holidays. Take them on cozy picnics on vast open spaces, or a day of adventure at San Mateo&rsquo;s first nature park. Enjoy a 270-degree panoramic view of nature&rsquo;s masterpieces. Watch the shimmering waters of Laguna de Bay and La Mesa Dam. Bask in the warmth of the sun as it rises from the peaks of nearby mountain ranges. Witness the sky display stunning colors as the sun sets over Manila Bay. Gaze at the scenic city skyline that seems to mirror a starry night.</p>\r\n<p>&nbsp;</p>\r\n<p>At Amiya Raya, experience all these without having to maneuver through endless traffic in the metropolitan area. Only 15 minutes away from the city, it is the perfect haven for those aspiring for a sanctuary that lets them take a breather from the daily rigors of work, but one that is also close enough to enjoy the modern comforts and conveniences of the city.</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"San Mateo\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6065000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 250, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/d540da5666cd7059ef8638beeeeda67d.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713534246, 1713534