(956, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-sunrise-villas-subdivision-in-san-andres-rizal-1713538666', 'Residential Lot for Sale at Sunrise Villas Subdivision in San Andres, Rizal', '[\"\"]', '<p>Sunrise Villas Subdivision emerges as an exciting new real estate endeavor in the Philippines, offering contemporary Filipino living spaces designed with sustainability in mind. Its strategic positioning, cutting-edge amenities, and diverse selection of units render it a compelling choice for individuals seeking a fresh residence or investment venture.</p>\r\n<p>Immerse yourself in a community where homes, workplaces, and recreational hubs seamlessly intertwine, crafting a unique lifestyle for its inhabitants. Sunrise Villas Subdivision by Maharlika Land, nestled in Cainta, Rizal, delivers a distinctive experience that exceeds residents&rsquo; discerning expectations, with its communities strategically positioned in the nation&rsquo;s key investment centers.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sunrise Villas Subdivision Amenities:</strong></p>\r\n<p>Additionally, secured parking areas are available. The residential enclave also boasts 24-hour security and CCTV systems, ensuring a tranquil community where residents can live without concern. Other notable features of the development include balconies, powder rooms, study areas, and garages.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Sunrise Villas Subdivision Location:</strong></p>\r\n<p>It transcends mere housing; it embodies a lifestyle that surpasses the ordinary, mirroring the ideal living standards of its residents. Situated in one of Cainta\'s most convenient areas, residents can leisurely explore the neighborhood, with parks, shopping centers, and restaurants conveniently nearby.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Nearby Establishments:</strong></p>\r\n<ul>\r\n<li>Cainta Catholic College</li>\r\n<li>Robinsons Malls Cainta</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>City of Laguna:</strong></p>\r\n<p>Laguna Province earned its name due to its surroundings of the southern and easternmost sections of Laguna de Bay. As the third largest province in the CALABARZON Region (Cavite, Laguna, Batangas, Rizal, and Quezon), it stands as a focal point for agriculture, fisheries, and forestry research in the Philippines.</p>\r\n<p>&nbsp;</p>\r\n<p>With its expansive agricultural and forested areas, the province serves as a rich source of various fruits, including lanzones, mangoes, papayas, pineapples, and rambutans, among others. Its adjacency to Laguna de Bay has also established the province as a thriving center for the fishing industry, catering to two-thirds of Metro Manila\'s fish requirements.</p>\r\n<p>&nbsp;</p>\r\n<p>Reservation fee: Php 75,000</p>\r\n<p>Monthly Downpayment: Pph 53,500</p>\r\n<p>Financing/Payment Terms: Bank</p>\r\n<p>Monthly Amortization: Php 56,208</p>', 'Residential Lot', '{\"barangay\":\"San Andres (Pob.)\",\"municipality\":\"Cainta\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 2160000, 75000.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 120, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/4e53f2ef7a0770d25a4f11d2f7d72b3e.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713538666, 1713538666, 1, 0, 1713513384, 4.101, NULL, 1),
