(965, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-new-fields-phase-2-in-teresa-rizal-1713539327', 'Residential Lot for Sale at New Fields Phase 2 in Teresa, Rizal', '[\"\"]', '<p><strong>Charming Haven</strong></p>\r\n<p>Get started on a bright future at&nbsp;<strong>New Fields</strong>, a well-planned community located within the 60-hectare, mixed-use Manna East development in Teresa, Rizal. With modern-minimalist homes and a range of amenities, this is an ideal choice for a family&rsquo;s first home.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features and Amenities:</strong></p>\r\n<ul>\r\n<li>Clubhouse</li>\r\n<li>Swimming Pool</li>\r\n<li>Kiddie Pool</li>\r\n<li>Play Area</li>\r\n<li>Multi-purpose Court</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Location</strong></p>\r\n<p>Manna East is located in Brgy. Dalig, Teresa, Rizal. Just a few minutes from Antipolo, Manna East is easily accessible with various types of public utility vehicles plying the area.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Landmarks:</strong></p>\r\n<ul>\r\n<li>Sta. Rosa de Lima Church &ndash; 2.4 km</li>\r\n<li>Teresa Elementary School &ndash; 2.7 km</li>\r\n<li>Teresa Public Market &ndash; 2.4 km</li>\r\n<li>Manila East Medical Center &ndash; 12 km</li>\r\n<li>SM Taytay &ndash; 13 km</li>\r\n<li>Robinsons Place &ndash; Antipolo &ndash; 8.9 km</li>\r\n<li>La Salle College of Antipolo &ndash; 6.4 km</li>\r\n<li>Assumption Antipolo &ndash; 9.3 km</li>\r\n<li>SM Masinag &ndash; 19 km</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Teresa, a quaint town with a population of 57,755 residents, is nestled along the lower slopes of the Sierra Madre Mountains. It shares borders with Antipolo City to the north, Tanay to the east, Angono to the west, and Morong to the south.</p>\r\n<p>&nbsp;</p>\r\n<p>Despite its economic diversity, Teresa maintains a tranquil atmosphere, distinguishing itself from many neighboring towns in the province that are often crowded or densely populated. This makes investing in a house and lot in Teresa, Rizal, an ideal choice for families seeking a peaceful environment to nurture their loved ones.</p>\r\n<p>&nbsp;</p>\r\n<p>HLURB LS No. 000637 (Phase 2) | Turnover Date: 2024</p>\r\n<p>Year Built: 2023</p>\r\n<p>Reservation fee: 10,000</p>\r\n<p>Monthly Downpayment: 13,624.69</p>\r\n<p>Financing/Payment Terms: Bank</p>\r\n<p>Monthly Amortization: 30,961.52</p>', 'Residential Lot', '{\"barangay\":\"Dalig\",\"municipality\":\"Teresa\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 3563300, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 127, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/1016cc603a86e9c4a178d8e34a8549bc.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713539327, 1713539327, 1, 0, 1713513991, 4.193, NULL, 1),
