(973, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'qc-lot-along-april-extension-street-congressional-avenue-proj-6-1713539810', 'QC LOT (Along April Extension Street, Congressional Avenue, Proj. 6 )', '[\"\"]', '<p>Good for residential development and commercial use. 30 Meters from Congressional Avenue</p>\r\n<p>&nbsp;</p>\r\n<p>LA: &nbsp;574sqm</p>\r\n<p>&nbsp;</p>\r\n<p>Developments</p>\r\n<p>- With around 200sqm warehouse</p>\r\n<p>-Office, employee\'s quarters, and 4 comfort room</p>\r\n<p>&nbsp;</p>\r\n<p>Sale Price P70,000sqm</p>\r\n<p>&nbsp;</p>', 'Residential Lot', '{\"barangay\":\"Bahay Toro\",\"municipality\":\"Quezon City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 40180000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 574, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/21fb4e6f4d8e1e3ef99b5af7d1d22522.jpeg', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713539810, 1713539810, 1, 0, 1713514539, 4.362, NULL, 1),
(974, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-for-sale-at-amarilyo-crest-in-taytay-rizal-1713539938', 'Residential Lot for Sale at Amarilyo Crest in Taytay, Rizal', '[\"\"]', '<p><strong>Overview</strong></p>\r\n<p>Bright new days await at&nbsp;<strong>Amarilyo Crest</strong>, a serene community characterized by quaint contemporary Asian architecture. This exclusive residential enclave situated in Taytay, Rizal boasts of panoramic views and a breathtaking sunset against lush mountains.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Features &amp; Amenities</strong></p>\r\n<p>Have a picnic, gaze out at the beautiful vista, or take a dip in the pool &ndash; enjoy memorable days with friends and family with Amarilyo Crest&rsquo;s invigorating amenities.</p>\r\n<ul>\r\n<li>Clubhouse</li>\r\n<li>Swimming Pool with Kiddie Pool</li>\r\n<li>Outlook Park</li>\r\n<li>Gazebo</li>\r\n<li>Parks and Open Spaces</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Within a Master-planned Townscape</strong></p>\r\n<p>Sprawling over 300 hectares, the Havila townscape invites you to live in this breathtaking setting that has inspired generations. Own your dream home surrounded by a panorama of verdant landscapes. Nurture family ties and lead a fulfilling life close to nature in Havila&rsquo;s residential communities &ndash; all within a captivating townscape where suburban serenity meets modern living. A life of ease and convenience awaits at Havila with San Beda College and PAREF Rosehill School both right within the townscape.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>House Model</strong></p>\r\n<p>Build your dream home with any of the open lots spread throughout the 8.8-hectare development or choose from four modern asian house models ranging from 63 sqm to 133 sqm &plusmn;. Whether you choose Iris, Tulip, Chopin MR or Vivaldi MR, you can be sure that each is carefully designed with features that have your preferences and needs in mind.</p>\r\n<p>&nbsp;</p>\r\n<p>Havila keeps residents close to modern conveniences. Schools such as San Beda College and PAREF Rosehill School are located within the township. The Ortigas CBD is just a 12-kilometer drive, while leisure, commercial, and medical establishments are within minutes away. A link road connects Havila&rsquo;s communities to each other and to outlying areas of travel.</p>\r\n<p>Amarilyo Crest is located at Brgy. San Juan, Taytay, Rizal.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How to get there:</strong></p>\r\n<p>Take Ortigas Avenue going to Antipolo. At Tikling Intersection, take Cabrera Road. From there, a five-minute drive will bring you to Havila.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Landmarks:</strong></p>\r\n<ul>\r\n<li>Manila East Medical Center &ndash; 1.6 km</li>\r\n<li>SM City Taytay &ndash; 3.1 km</li>\r\n<li>Ynares Center &ndash; 3.5 km</li>\r\n<li>Shopwise &ndash; 2.1 km</li>\r\n<li>Unciano Medical Center &ndash; 2.4 km</li>\r\n<li>SM City Marikina &ndash; 13.8 km</li>\r\n<li>Robinsons Galleria &ndash; 11.7 km</li>\r\n<li>La Salle College Antipolo &ndash; 7.9 km</li>\r\n<li>Assumption Antipolo &ndash; 5.6 km</li>\r\n<li>Valley Golf and Country Club &ndash; 3.7 km</li>\r\n<li>The Medical City &ndash; 10.7 km</li>\r\n<li>Thunderbird Resorts &ndash; 4.4 km</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>HLURB LS No. 031519 | Completion Date: 04/2017</p>\r\n<p>Reservation fee: 20,000</p>\r\n<p>Monthly Downpayment: 123,028.33</p>\r\n<p>Financing/Payment Terms: Bank, In-house</p>\r\n<p>Monthly Amortization: &nbsp;64,318.98</p>', 'Residential Lot', '{\"barangay\":\"San Juan\",\"municipality\":\"Taytay\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 7481700, 20000.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 180, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/df668110440ff203cfe81efd89d09f4f.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713539938, 1713539938, 1, 0, 1713514593, 4.265, NULL, 1),
