(1002, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'oro-vista-1713543021', 'ORO VISTA', '[\"\"]', '<p>A Vision to flourish</p>\r\n<p>&nbsp;</p>\r\n<p>Look forward to a life among the charming greeneries and pursue</p>\r\n<p>the potential of your dream property by securing your own&nbsp;</p>\r\n<p>residential haven in Oro Vista.</p>\r\n<p>&nbsp;</p>\r\n<p>A safe haven among the green</p>\r\n<p>&nbsp;</p>\r\n<p>Settle down roots</p>\r\n<p>&nbsp;</p>\r\n<p>Set to rise in the blisshful town of</p>\r\n<p>Halayhayin in Pililla Rizal, Oro Vista is a modern residential development designed to be a restful retreat for those who savor</p>\r\n<p>the gentle touch of nature and appreciates the comforts of prime</p>\r\n<p>modern living.</p>\r\n<p>&nbsp;</p>\r\n<p>Explore the peak of harmony</p>\r\n<p>&nbsp;</p>\r\n<p>With it\'s gentle rising landscaped, Halayhayin is a refreshing location that helps create an uplifting ambiance for the eventual residents &nbsp;of Oro Vista, inspiring</p>\r\n<p>them to embrace a healthy and active lifestyle and active lifestyle.</p>\r\n<p>The name Halayhayin itself is said</p>\r\n<p>to originate from the tagalog term\" lahay\" which means \" to relax\", or&nbsp;</p>\r\n<p>\"to rest\".</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Tanay\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 864000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 150, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/30c18b9907bf069d72f87667cf1c516d.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574