(1007, 1143, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '293-sqm-residential-lot-for-sale-in-lausanne-at-crosswinds-tagaytay-city-cavite-1713543495', '293 sqm Residential Lot for Sale in Lausanne at Crosswinds Tagaytay City, Cavite', '[\"\"]', '<p>Crosswinds is the country&rsquo;s only pine estate, with over 35,000 pine trees that lend their heady scent to the cool air that jackets the development. It is decked with quaint chalets offering the fun of a first-class Swiss resort and commercial strip.</p>\r\n<p>Because of its charm and prime location, homes in Crosswinds are in very high demand. In response to this, another property beside the estate is being developed, Lausanne. This 24-hectare area boasts of enchantingly sweeping panoramas with views of the lush hills of Tagaytay, the calm Laguna de Bay, and the skyline of the Metro.</p>\r\n<p>This first tranche of pre-selling luxury lots for sale are located at the highest elevation of the area.</p>\r\n<p>&nbsp;</p>\r\n<p>Imagine having a piece of real estate in the prestigious neighborhood of Lausanne at Crosswinds Tagaytay. A property in the Philippines with an international feel might be yours to own if you purchase one of the pre selling lots for sale in Tagaytay.</p>\r\n<p>Every morning, you will wake up to the smell of the&nbsp;pine cones, which will be accompanied by a brisk breeze &ndash; It is the luxury living you can experience in Crosswinds</p>\r\n<p>&nbsp;</p>\r\n<p><strong>A Beautiful View for the Privileged Few in Lausanne at Crosswinds | Pre Selling Lots For Sale in Tagaytay</strong></p>\r\n<p>An ultra-premium selection of pre selling lots for sale in Tagaytay is made available in Lausanne. These lots will undoubtedly stand out as a cut of a beautiful place, which makes Lausanne an ideal choice for discerning buyers who want to live surrounded by nature but within the comforts of city life and accessibility to establishments and road infrastructures while remaining away from the madding crowd.</p>\r\n<p>&nbsp;</p>\r\n<p>Lot Property for Sale in Iruhin East, Tagaytay, Cavite</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Tagaytay\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 29000000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 293, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/04d95fe1f6957a3081f2c3c9b8af78a2.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713543495, 1713543495, 1, 0, 1713518140, 3.908, NULL, 1),
