(1017, 1142, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'just-listed-738-sqm-prime-lot-for-sale-in-eastland-heights-antipolo-rizal-1713544530', 'Just Listed!! 738 sqm, Prime Lot for Sale in Eastland Heights, Antipolo, Rizal', '[\"\"]', '<p>GOLFING COMMUNITY RIGHT OUTSIDE THE BUSTLING CITY LIMITS</p>\r\n<p>&nbsp;</p>\r\n<p>Eastland Heights boasts of the Forest Hills Golf Course as its centerpiece&mdash;the only golf club in the Philippines with two courses. Also presenting afar in the southwest is the Ortigas skyline that twinkles by night; just a little tilt of the head to the west, one enjoys an unobstructed view of the sunset. Also visible is Laguna de Bay and Mount Makiling, making every angle picture perfect. In the morning the sun emits its healing rays around the place.</p>\r\n<p>&nbsp;</p>\r\n<p>Property Details:</p>\r\n<p>- Phase 1 F B42 L4</p>\r\n<p>- 738 Sqm.</p>\r\n<p>- in front of a Vast Open Space</p>\r\n<p>- near the club house and entrance gate</p>\r\n<p>- Prime Lot</p>\r\n<p>&nbsp;</p>\r\n<p>Deed of Assignment</p>\r\n<p>Inclusive of Taxes &amp; Fees</p>\r\n<p>Price per SQM Php 13,500</p>\r\n<p>Total Selling Price: Php 9,963,000</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Amenities:</p>\r\n<p>- 36 hole Fairway Golf Course</p>\r\n<p>- Driving Range</p>\r\n<p>- Event Pavilion</p>\r\n<p>- Swimming Pool for Adult and Kids</p>\r\n<p>- Spa Concessionaire</p>\r\n<p>- Basketball Court</p>\r\n<p>- Tennis Court</p>\r\n<p>- Gym</p>\r\n<p>&nbsp;</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Antipolo\",\"province\":\"Rizal\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 9963000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 738, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/89bb943fdfff