ot Details:</p>\r\n<p>Price per SQM Php 28,000</p>\r\n<p>Facing East</p>\r\n<p>RFO</p>\r\n<p>Inner Lot -Flat</p>\r\n<p>Block 12C</p>\r\n<p>238 SQM</p>\r\n<p>Updated Taxes</p>\r\n<p>Titled</p>\r\n<p>Cash only</p>\r\n<p><strong>Total Contract Price PHP 6,664,000</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;</p>\r\n<p>** Properties are Subjected for confirmation and availability**</p>\r\n<p>&nbsp;</p>\r\n<p>**Strictly for Direct Buyers only, No Agent or Brokers please.**</p>\r\n<p>&nbsp;</p>\r\n<p>For schedule of tripping or Online Presentation, please feel free to contact me now!!</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you, Stay safe!</p>\r\n<p>LOREZA DEXRA ASISTIO</p>\r\n<p>Accredited Salesperson</p>\r\n<p>HLURB # 014650</p>\r\n<p>PRC # 0024171</p>\r\n<p>Area Manager</p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"Carmona\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 6664000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 238, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/1754bd58c5ce6f66e9d93be9101638fa.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713550770, 1713550770, 1, 0, 1713525487, 3.857, NULL, 1),
