(1073, 1139, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '2-bedroom-condo-unit-at-the-sofia-terraces-in-quezon-hills-baguio-city-1713573643', '2-Bedroom Condo Unit at The Sofia Terraces in Quezon Hills, Baguio City', '[\"\"]', '<p>Overview</p>\r\n<p>Amenities</p>\r\n<p>Listings</p>\r\n<p>Loan Calculator</p>\r\n<p>Location</p>\r\n<p>\"Elevating the way you live\"</p>\r\n<p>&nbsp;</p>\r\n<p>Following the success of its first two condominium projects in the country&rsquo;s summer capital, Suntrust Properties recaptures the scenic beauty of Baguio City through its newest vertical village, Sofia Terraces. Elevated in a sloped terrain, Sofia Terraces paints you a magnificent picture of the City of Pines, with a panoramic view of the city&rsquo;s mesmerizing lights in the nighttime, and an awe-striking pine tree hillside in the daytime.</p>\r\n<p>&nbsp;</p>\r\n<p>Specifically designed to blend in with the terrain, Sofia terraces will be your own escape from the bustling city to a picturesque mountainside that puts you at the peak of serenity, and lets you enjoy the weather and misty air of Baguio City, right within your own community. Inside the development is a spacious podium level that offers an open space for you and your family to wander. Keep fit at the gym, take pictures by the pool, and tour your friends around the landscaped open space, all amenities are made available outside your doorsteps.</p>\r\n<p>&nbsp;</p>\r\n<p>Indeed, Sofia Terraces is your own definition of &ldquo;unwind&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Condominium', '{\"barangay\":\"Quezon Hill Proper\",\"municipality\":\"City of Baguio\",\"province\":\"Benguet\",\"region\":\"CAR\",\"street\":\"\",\"village\":\"\"}', 5940000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 45, 0, 0, 2, 1, 0, 'https://mls.rosimulator.website/Cdn/images/listings/4c90e3dcfc4346135c7d222883dff11e.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713573643, 1713573643, 1, 0, 1713547878, 4.128, NULL, 1);
