(1121, 1141, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'elaro-828sqm-park-estate-lot-1713579052', 'Elaro 828sqm Park Estate Lot', '[\"New\"]', '<p>If you are looking for Elaro 828sqm Park Estate Lot for Sale, this is it!</p>\r\n<p>Elaro is envisioned to be a community that promotes healthy outdoor living.</p>\r\n<p>&nbsp;</p>\r\n<p>Highlighting life&rsquo;s simple pleasures, this Ayala Land Premier residential development embraces the community in its natural landscape.</p>\r\n<p>&nbsp;</p>\r\n<p>Located next to the NUVALI Wildlife and Bird Sanctuary, Elaro seeks to provide a lifestyle allowing families to immerse in the outdoors while enjoying the urban conveniences provided by its ideal environment in the South.</p>\r\n<p>&nbsp;</p>\r\n<p>A gently rolling terrain, Elaro is situated at an elevation that ranges from 121 to 161 meters above mean sea level and with magnificent views of Tagaytay Ridge (west) and Mt. Makiling (southeast).</p>\r\n<p>&nbsp;</p>\r\n<p>Fourth Ayala Land Premier development in NUVALI, it is accessible via ACTEx through Mamplasan (with GDC stickers only), Sta. Rosa, Silang and Eton exits. Elaro&rsquo;s main gate is located on the road after Treveia.</p>\r\n<p>&nbsp;</p>\r\n<p>Elaro is a part of NUVALI which is the country&rsquo;s first and largest eco-city development, built on the principles of sustainable design. A project of Ayala Land, NUVALI is a 2,400-hectare mixed-use development that straddles the cities of Sta. Rosa, Cabuyao and Calamba in Laguna.</p>', 'Residential Lot', '{\"barangay\":\"Santo Domingo\",\"municipality\":\"City of Santa Rosa\",\"province\":\"Laguna\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 38088000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 828, 0, 0, 0, 0, 'https://mls.ro