(1141, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Commercial', 0, '600-sqm-prime-commercial-lot-in-kamias-rd-quezon-city-nr-ali-mall-1713580810', '600 sqm Prime Commercial Lot in Kamias Rd. Quezon City Nr. Ali Mall', '[\"\"]', '<p>Category :&nbsp;<strong>For Sale</strong></p>\r\n<p>Project :&nbsp;<strong>Commercial Property</strong></p>\r\n<p>City :&nbsp;<strong>Kamias Road, Quezon City</strong></p>\r\n<p>Size :&nbsp;<strong>600 sqm</strong></p>\r\n<p>Price per sqm :<strong>&nbsp;Php 120,000.00</strong></p>\r\n<p><br />Selling Price :&nbsp;<strong>From Php 90,000,000.00 Down to Php 72,000,000.00 NET</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Details of the Property:</strong></p>\r\n<p>&bull; Clean title</p>\r\n<p>&bull; With existing structure</p>\r\n<p>&bull; Along Main Road</p>\r\n<p>&bull; With wide frontage</p>\r\n<p>&bull; Located in highly commercialize area</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;For 2 lots only</strong><br />&bull; Available lots for sale: Lot 15 and 16<br />&bull; Total lot size: 600 sqm<br />&bull; Price/sqm: 120k/sqm</p>\r\n<p>&nbsp;</p>\r\n<p>Quezon City it is home to many government offices, including the House of Representatives, the lower chamber of the Congress of the Philippines. It is also the location of two of the most prominent universities of the nation&mdash;the University of the Philippines in Diliman, which is the national university, and the Ateneo de Manila University.</p>\r\n<p>This prime commercial lot is strategically located in Diliman, Quezon City, It is very accessible to transport hubs, malls, restaurants, banks, churches, and other commercial establishments. Investing in this property can generate great benefits.</p>\r\n<p>it&rsquo;s also an excellent investment opportunity and potential business venture. These luxury properties yield a substantial income and return on investment should you decide to rent out or sell them in the future.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>WHY COMMERCIAL PROPERTY IS A GOOD INVESTMENT?</strong></p>\r\n<p>1. Higher income yields &ndash; commercial properties generally show a greater level of income for a given property value, when compared to residential property.</p>\r\n<p>2. Capital growth potential is based on income growth potential and other measurable factors</p>\r\n<p>&ndash; commercial properties are often valued on the basis of the potential (and actual) rental return being achieved. Other relevant factors include economic activity, interest rates, and the commercial success of the area surrounding the property.</p>\r\n<p>3. Stability and consistency of income &ndash; longer leases. Whilst residential properties are typically held on short leases (often 12 months), commercial properties typically attract longer lease terms between three and 10 years, providing consistent and predictable income streams over time.</p>\r\n<p>4. Income growth &ndash; the longer leases of commercial properties usually allow for the rent to increase in every year of the lease, thus increasing the return on investment as the lease progresses.</p>\r\n<p>5. Maintenance &ndash; unlike residential investors, commercial investors have the potential to earn enhanced profit, with the lessee responsible for paying the cost of maintenance, rates and repairs on the property when the ongoing expenses are written into the commercial lease agreement.</p>\r\n<p>6. Reliable tenants &ndash; we have all heard stories of &ldquo;horror tenants&rdquo; in houses and apartments. Tenants of commercial properties, on the other hand, are earning their income from the property. Therefore, it is in their interests to keep the property in good order and to maintain good relations with the landlord.</p>\r\n<p>7. Diversification &ndash; commercial property investment can provide diversification across different asset classes and geographic locations, allowing the investor to add further elements of diversification into their portfolio. By diversifying their portfolio and investing in a variety of commercial assets, from retail to industrial, investors are also protecting their income and managing risk in the event of an economic downturn.</p>\r\n<p>8. Ability to collectively invest &ndash; the ability to own commercial property within investment structures, such as property managed investment trusts, allows investors to hold part of a larger asset and to benefit from professional management of both the asset and the investment vehicle, which will also be subject to annual audit.</p>', 'Commercial Lot', '{\"barangay\":\"East Kamias\",\"municipality\":\"Quezon City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 72000000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 600, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/47377938fd319d5d27c4aabb4f3fd360.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713580810, 1713580810, 1, 0, 1713555533, 4.451, NULL, 1),
