als such as Festival Mall and Alabang Town Center are located.</p>\r\n<p><strong>Central Park</strong></p>\r\n<ul>\r\n<li>The Clubhouse<br />&ndash; Multiple alfresco lanais with views of the infinity pool and The Grand Lawn<br />&ndash; Function rooms with outdoor spill-over areas<br />&ndash; Fitness Gym<br />&ndash; Infinity lap and lounge pools<br />&ndash; Sunken pool lounge<br />&ndash; Kiddie pool</li>\r\n<li>The Grand Lawn<br />&ndash; Garden nooks<br />&ndash; Hammock grove<br />&ndash; Outdoor children&rsquo;s play area<br />&ndash; Picnic grounds</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Linear park network</strong></p>\r\n<ul>\r\n<li>Backyard spill-over lawns</li>\r\n<li>Prairie walks</li>\r\n<li>Convergence nooks with park benches and picnic tables</li>\r\n<li>Organized bike and marathon trails</li>\r\n<li>Meandering parks and greenways</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Pocket parks</strong></p>\r\n<ul>\r\n<li>Basketball court</li>\r\n<li>Outdoor play area</li>\r\n<li>Garden lawns</li>\r\n<li>Village gazebos</li>\r\n</ul>', 'Residential Lot', '{\"barangay\":\"Canlubang\",\"municipality\":\"City of Calamba\",\"province\":\"Laguna\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 12285000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 351, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/d0cc216db484d5e60cb754c78f6d0917.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713581742, 1713581742, 1, 0, 1713556348, 4.064, NULL, 1),
