trong>Reasons to Invest:</strong></p>\r\n<p>&bull;Ideal Location</p>\r\n<p>&bull;Very Accessible</p>\r\n<p>&bull;Flexible Terms Available</p>\r\n<p>&bull;High Investment Potential</p>\r\n<p>&bull;Within reach of Commercial Area</p>\r\n<p>&bull;Near De La Salle Zobel Vermosa</p>\r\n<p>&bull;Low Capital Exposure</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Accessible via:</strong></p>\r\n<p>MCX</p>\r\n<p>SLEX</p>\r\n<p>CAVITEX</p>\r\n<p>CALAX (Future Development)</p>\r\n<p>Skyway Ext. (Future Development)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Advantages of Acquiring Lots today:</strong></p>\r\n<p>Lower Introductory Price</p>\r\n<p>Fresh Inventory &amp; Opportunity To Buy in Bulk</p>\r\n<p>Exclusive Terms &amp; Discounts</p>\r\n<p>Higher Rate of Return</p>\r\n<p>&nbsp;</p>\r\n<p>Lots are coming out really fast!</p>\r\n<p><strong>Reservation: ?100,000</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>For Site Tripping, Quotation, &amp; Presentation send us a message!</strong></p>', 'Residential Lot', '{\"barangay\":\"\",\"municipality\":\"City of Imus\",\"province\":\"Cavite\",\"region\":\"Region IV-A\",\"street\":\"\",\"village\":\"\"}', 12985714, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 288, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/08ec835b5bf5470c7cf912b0e5edebf8.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713588952, 1713588952, 1, 0, 1713563691, 3.917, NULL, 1),
