(1364, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, '300-sqm-prime-lot-in-guadalupe-viejo-makati-city-nr-bgc-stlukes-1713620911', '300 sqm Prime Lot in Guadalupe Viejo Makati City Nr. BGC St.Lukes', '[\"\"]', '<p>Project :&nbsp;<strong>Residential/Commercial Property</strong></p>\r\n<p>City :&nbsp;<strong>Guadalupe Viejo, Makati City</strong></p>\r\n<p>Size :&nbsp;<strong>300 sqm</strong></p>\r\n<p>Price per sqm :&nbsp;<strong>Php 145,000.00&nbsp;</strong></p>\r\n<p>Selling Price :&nbsp;<strong>Php 43,500,000.00 Gross</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Details of the Property:</strong></p>\r\n<p>&bull; &nbsp;&nbsp;Clean title</p>\r\n<p>&bull; &nbsp;&nbsp;Ideal for dorm, Residential or commercialization Building</p>\r\n<p>&nbsp;</p>\r\n<p>Makati is a city in the Philippines&rsquo; Metro Manila region and the country&rsquo;s financial hub. It&rsquo;s known for the skyscrapers and shopping malls of Makati Central Business District, and for Ayala Triangle Gardens, an area dotted with trees and sculptures. Ayala Museum houses the Filipinas Heritage Library and craft collections documenting the country&rsquo;s history. The Rizal Monument is a memorial to national hero Jose Rizal.</p>\r\n<p>&nbsp;</p>\r\n<p>Makati&rsquo;s highly developed multi-modal transport infrastructure has made it the most centralized city in Metro Manila and the National Capital Region. The creation and availability of various forms of public transportation, such as the upcoming Makati Subway and the existing Metro Rail Transit (MRT), jeepneys and buses, complemented by a road network that links the city to the rest of Metro Manila, ensures accessibility and convenience.</p>\r\n<p>&nbsp;</p>\r\n<p>The city is known as the financial center of the Philippines, as well as one of the popular shopping hubs in the capital. Each day, millions of people come to the city to work, shop, and dine. As the headquarters of the Philippine Stock Exchange, Smart Communications Incorporated, and SM Development Corporation just to name a few top 100 companies, the city is equated with money. Being located here means that you as a business owner or as an employee are successful.</p>', 'Residential Lot', '{\"barangay\":\"Guadalupe Viejo\",\"municipality\":\"Makati City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"\",\"village\":\"\"}', 43500000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 300, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/9c791f742ea2df2b37fe660a1c32543f.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713620911, 1713620911, 1, 0, 1713595581, 4.584, NULL, 1),
(1365, 1138, 1, '{\"local_board\":1,\"local_region\":1,\"all\":1}', 1, 0, 'for sale', 'Residential', 0, 'residential-lot-in-villa-kalayaan-kalayaan-avenue-across-bgc-taguig-1713621081', 'Residential Lot in Villa Kalayaan Kalayaan Avenue across BGC Taguig', '[\"\"]', '<p>Villa Kalayaan Subdivision, Kalayaan Ave, Makati City, Metro Manila Philippines - an exclusive and gated small subdivision with park and security guards, right across PhilPlans Bldg., BGC</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Property Code: 101-SRL-VKN</p>\r\n<p>&bull; Residential Lot, House for demolition</p>\r\n<p>&bull;Size: 300 sqm</p>\r\n<p>&bull; Clean Title&nbsp;</p>\r\n<p>&bull; Selling Price: Php 45M (Php 150k/sqm)</p>\r\n<p>&nbsp;</p>\r\n<p>For a bigger lot requirement, lot expandable to 450 sq.m and up to a maximum of 750 sq.m.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Strategically located across Bonifacio Global CIty - within close proximity to Uptown Bonifacio, Veritown Fort, SM Aura, Market! Market!, St. Lukes-BGC, DLSU and UP BGC campuses, International Schools</p>\r\n<p>&bull; Ideal for Dormitory/Apartment/Mini-Condominium/Duplex/Townhouse/House/Mixed-use developments.</p>\r\n<p>&bull; Secured Community - With roving village guards, CCTV cameras for day and night surveillance</p>\r\n<p>&bull; Residential Community Vibe Ambiance - Gated community, village with park and trees, zero occurrence of flooding, community vibe despite being close to BGC commercial district</p>\r\n<p>&bull; Proximity to new key commercial and infrastructure developments - BGC-Ortigas Center Link Road, Monorail project by Megaworld which will connect Guadalupe MRT Station to Uptown Bonifacio, the planned Kalayaan Ave. subwaymstation, Grand Central Park Estate / Veritown Fort by Metrobank-Federal Land Inc.</p>\r\n<p>&nbsp;</p>', 'Residential Lot', '{\"barangay\":\"West Rembo\",\"municipality\":\"Makati City\",\"province\":\"Metro Manila\",\"region\":\"NCR\",\"street\":\"KALAYAAN AVE\",\"village\":\"Villa Kalayaan Subdivision\"}', 45000000, 0.00, '{\"option_money_duration\":\"30\",\"payment_mode\":\"Cash\",\"tax_allocation\":\"Seller Agrees to Pay Capital Gains Tax and Buyer Pays Transfer Tax\",\"bank_loan\":1,\"pagibig_loan\":0,\"assume_balance\":0}', 0, 300, 0, 0, 0, 0, 'https://mls.rosimulator.website/Cdn/images/listings/5af6cfb713995534ba2ce02a1949191a.webp', NULL, 'Club House,24 Hours Security,Guard House,Gated Community,CCTV Cameras,Near Malls,Near Hospitals,Near Public Markets,Near in Churches,Near in Schools', '{\"authority_type\":\"N\\/A\",\"authority_to_sell_expiration\":1735574400,\"com_share\":\"50\"}', 1713621081, 1713621110, 1, 45000000, 1713595739, 4.573, NULL, 1),
