(1, 'PAREB MLS', '{\"mobile_number\":\"09199999999\",\"email\":\"myorg@email.com\",\"office_address\":\"55 sitio st brgy pinagkaisahan quezon city\",\"contact_page_text\":\"Donec a lobortis diam. Sed eu accumsan lectus. Nunc viverra eros non dui euismod interdum viverra vitae libero. Vestibulum fringilla, eros id volutpat mattis, ipsum ipsum elementum elit, quis posuere erat nisl ac augue. Etiam nec vehicula massa. Donec eget eros non tellus suscipit lobortis. Pellentesque dapibus ante augue, sed luctus nunc laoreet vel.\"}', '[\"New\",\"Pre-Owned\",\"Fully Furnished\",\"Bare Unit\",\"Pre-Sale\",\"Ready for Occupancy\"]', '{\"client_id\":\"AczoZMmV6Tkw24LL55FDfCaCMsp7aSo5bf75EFLy22u0nswrH15Cmrac2tsimtGCLaiU35vb605Pi3oF\",\"client_secret\":\"EOxCjX0hgxSaffhW1QEFZcqto_LBL_qnAIl22TuYH1sVio-AljiMdb6ti95V8z0lb_RbKLexNcSSibE0\"}', 1, 0, '{\"ip_address\":\"localhost\",\"port\":\"8555\"}', '{\"email\":\"noreply@emailserver.com\",\"password\":\"1234567890\",\"host\":\"mail.emailserver.com\",\"port\":\"587\"}', 1, 1, 0, '{\"max_post\":\"15\",\"max_users\":\"2\",\"mls_access\":\"1\",\"chat_access\":\"1\",\"featured_ads\":\"0\",\"handshake_limit\":\"1\",\"comparative_analysis_access\":\"0\"}', NULL, NULL, '<h3 style=\"text-align: justify;\">Privacy Statement</h3>\r\n<p style=\"text-align: justify;\">Your personal information is important to My Organization., its employees, agents or representatives (collectively referred to as \"Organization\", \"we\", \"us\" or \"our\"). We handle your personal information and data in accordance with Republic Act No. 10173, otherwise known as the Data Privacy Act of 2012, and its Implementing Rules and Regulations, other issuances of the National Privacy Commission and other relevant laws of the Philippines (collectively, the \"DPA\"). We recognize the importance of your rights as a Data Subject under the DPA, as follows:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Right to be informed</li>\r\n<li>Right to object</li>\r\n<li>Right to access</li>\r\n<li>Right to correct</li>\r\n<li>Right to rectification, erasure or blocking</li>\r\n<li>Right to damages</li>\r\n<li>Right to data portability</li>\r\n<li>Transmissibility of rights</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">This Privacy Policy aims to provide information on how we collect, use, manage, and secure your personal information. Any information you provide to us indicates your express consent to our Privacy Policy.</p>\r\n<h3 style=\"text-align: justify;\">Personal Information Collection</h3>\r\n<p style=\"text-align: justify;\">Personal Information under the DPA refers to any information, whether recorded in a material form or not, from which the identity of an individual is apparent or can be reasonably and directly ascertained by the entity holding such information, or such information, when put together with other information, would directly and certainly identify an individual.</p>\r\n<p style=\"text-align: justify;\">In the performance of our services, or as part of our transactions and dealings, we collect your personal information which may include, but not limited to, the following:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Your name, nationality, civil status, gender, age, birthdate, ID details, unique identifiers, email address, residence, office, and mailing address, phone numbers and other information, as part of our transactions and dealings with you.</li>\r\n<li>Your browsing and social media behavior, when you browse into our website, download mobile applications and tag or mention us on your social media accounts.</li>\r\n<li>Any information you submit when to our sales, account management, or customer relations agents for update of your records or information; in relation to your inquiries or requests; when you participate in our survey, discount, event information and prize promotion; when you refer a person to verify the information you provided to us; when you visit and connect to our websites and social media pages; or any other event or activity that may be similar or related to any of the foregoing.</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">When you provide information other than your own, you certify that you have obtained the consent and authority of the owner of such information (such as your parents, spouse, children, dependent, or any other person) to allow us to disclose and process such information.</p>\r\n<h3 style=\"text-align: justify;\">Use and Sharing of Personal Information</h3>\r\n<p style=\"text-align: justify;\">We use your personal information to:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Process the products and services that you have availed from us.</li>\r\n<li>Communicate our latest products, services, promos and events.</li>\r\n<li>Respond immediately to your needs, requests, queries and complaints.</li>\r\n<li>Comply with the law, rule or regulation and all legal orders and processes.</li>\r\n<li>Process your application and conduct due diligence for, and documentation of, our transaction.</li>\r\n<li>Any other purpose relating to any of the above.</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">We share your personal information, to the extent that is reasonable and necessary, to:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Our employees or other personnel handling your transactions, orders or requests.</li>\r\n<li>Banks, insurers or professional advisers in connection with due diligence and documentation of your transaction.</li>\r\n<li>Any third-party service provider performing financial, administrative, technical and other ancillary services.</li>\r\n<li>Government institution and other competent authorities which by law, rules or regulations require us to disclose your personal information.</li>\r\n<li>Any person or entity we contractually entered with and who ensures the confidentiality standard we implement and adheres to the DPA.</li>\r\n<li>Any person in order to carry out functions of public authority, and for collection and further processing pertaining to law enforcement, taxation or other regulatory function.</li>\r\n</ol>\r\n<h3 style=\"text-align: justify;\">Personal Information Retention and Protection</h3>\r\n<p style=\"text-align: justify;\">We retain your personal information:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>To the extent necessary in keeping track of your transaction and records.</li>\r\n<li>As may be agreed upon by the parties to a contract.</li>\r\n<li>For statistical, research and other purpose specifically authorized by law.</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">Data collected will be retained in accordance with retention limit set by our standards, industry standards and laws and regulations, unless you request your data to be deleted in our database.</p>\r\n<p style=\"text-align: justify;\">To maintain the integrity and confidentiality of your personal information, we put in place organizational, physical and technical security measures to protect your personal information, such as:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li>Use of secured servers, firewalls, encryptions and other latest security tools.</li>\r\n<li>Limited access to personal information to those duly authorized processors. All transfers are made after complying with the established confidentiality policy and practices in place.</li>\r\n<li>Maintain a secured server operating environment by performing regular security patch update and server hardening.</li>\r\n</ol>\r\n<h3 style=\"text-align: justify;\">Cookies and Related Technologies</h3>\r\n<p style=\"text-align: justify;\">A cookie is a small piece of file which originates from a website and is transferred to the user\'s hard drive to record the user\'s browsing activity. Cookies were designed to remember pieces of information that the user has entered in a certain website. Essentially, cookies help in making the browsing of our site easier by, among other things, saving your name, addresses, passwords and other preferences.</p>\r\n<p style=\"text-align: justify;\">Most web browsers are set to automatically accept cookies, but you have the option to refuse all cookies or indicate when a cookie is being sent. However, if you choose not to accept cookies, you may experience some delay in browsing our website or it will not function properly or may be considerably slower.</p>\r\n<h3>Google Analytics</h3>\r\n<p>We use Google Analytics, an analytics service provided by Google LLC. We use this service to help analyze how users use the Service, with a view to analyzing usage across devices and offering improvements for all users. To learn more about Google Analytics, please visit their <a href=\"https://support.google.com/analytics/answer/6004245#zippy=%2Cour-privacy-policy\">Privacy Policy</a>. To opt-out of this feature by installing the Google Analytics Opt-out Browser Add-on, please click <a href=\"https://tools.google.com/dlpage/gaoptout?hl=en\">here</a>.</p>\r\n<h3>Newsletters</h3>\r\n<p>You can opt out of receiving our marketing emails and/or newsletters by contacting us as described under &ldquo;Contact Us&rdquo; below. We may still send you transactional messages, which include Services-related communications and responses to your questions.</p>\r\n<h3 style=\"text-align: justify;\">Renewal of Policy</h3>\r\n<p style=\"text-align: justify;\">We may periodically update or amend our Privacy Policy in order to adhere to new and existing laws affecting the DPA, including any change or improvement we establish to secure your personal information. Any updates or changes shall not alter how we handle previously collected personal data without obtaining your consent, unless required by law.</p>', '<h3>Introduction</h3>\r\n<p>This page states the terms and conditions under which you may use the website, [website name]. [website name] is operated by an Individual Trying to help Real Estate Brokers and Salespersons to increase their presence on the internet</p>\r\n<p><strong>Definitions</strong></p>\r\n<ul>\r\n<li>The terms \"you\" and \"user\" as used herein refer to all individuals and/or entities accessing [website name]</li>\r\n<li>The term \"Website\" as used herein refers to [domain name]</li>\r\n</ul>\r\n<p><strong>General</strong></p>\r\n<p>By using the Website, you are indicating your acceptance to be bound by these terms and conditions. The Website may revise these terms and conditions at any time by updating this page. You should visit this page periodically to review the terms and conditions, to which you are bound.</p>\r\n<p><strong>Terms of Use</strong></p>\r\n<ul>\r\n<li>Users may not use the Website in order to transmit, distribute, store or destroy material:\r\n<ul>\r\n<li>in violation of any applicable law or regulation;</li>\r\n<li>in a manner that will infringe the copyright, trademark, trade secret or other intellectual property rights of others or violate the privacy, publicity or other personal rights of others;</li>\r\n<li>that is defamatory, obscene, threatening, abusive or hateful.</li>\r\n</ul>\r\n</li>\r\n<li>The following is prohibited with respect to the Website:\r\n<ul>\r\n<li>Using any robot, spider, other automatic device or manual process to monitor or copy any part of the Website;</li>\r\n<li>Using any device, software or routine or the like to interfere or attempt to interfere with the proper working of the Website.</li>\r\n<li>Taking any action that imposes an unreasonable or disproportionately large load on the Website infrastructure;</li>\r\n<li>Copying, reproducing, altering, modifying, creating derivative works, or publicly displaying any content from the Website without the Website`s prior written permission;</li>\r\n<li>Reverse assembling or otherwise attempting to discover any source code relating to the Website or any tool therein, except to the extent that such activity is expressly permitted by applicable law notwithstanding this limitation; and</li>\r\n<li>Attempting to access any area of the Website to which access is not authorized.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>Copyright and Intellectual Property Rights</strong></p>\r\n<ul>\r\n<li>All content, trademarks and data on this Website, including but not limited to, software, databases, text, graphics, icons, hyperlinks, private information, and designs are the property of or licensed to the Website.</li>\r\n<li>Users of this Website are not granted a licence or any other right including without limitation under Copyright, Trade Mark, Patent or Intellectual Property Rights in/or to the content.</li>\r\n</ul>\r\n<p><strong>Security</strong></p>\r\n<ul>\r\n<li>Users are prohibited from violating or attempting to violate the security of the Website, including, but without limitation:\r\n<ul>\r\n<li>accessing data not intended for such user or logging into a server or account which the user is not authorized to access;</li>\r\n<li>attempting to probe, scan or test the vulnerability of a system or network or to breach security or authentication measures without proper authorization;</li>\r\n<li>attempting to interfere with service to any user, host or network, including, without limitation, via means of submitting a virus to the website, overloading, \"flooding\", \"spamming\", \"mail bombing\" or \"crashing\";</li>\r\n<li>sending unsolicited email, including promotions and/or advertising of products or services;</li>\r\n<li>forging any TCP/IP packet header or any part of the header information in any email or newsgroup posting;</li>\r\n<li>deleting or revising any material posted by any other person or entity;</li>\r\n<li>using any device, software or routine to interfere or attempt to interfere with the proper working of this website or any activity being conducted on this site.</li>\r\n</ul>\r\n</li>\r\n<li>Violations of system or network security may result in civil or criminal liability. The Website will investigate occurrences, which may involve such violations and may involve, and cooperate with, law enforcement authorities in prosecuting users who are involved in such violations.</li>\r\n</ul>\r\n<p><strong>Disclaimer</strong></p>\r\n<ul>\r\n<li>The Website carries property advertisements, news, reviews and other content independently published by third parties on the website. The Website is not involved in the buying, selling or development of the property process and must not be considered to be an agent, buyer and/or a developer with respect to the use of the Website.</li>\r\n<li>The Website shall not be responsible for any user entering into agreements or making decision whatever nature in connection with the posting of property ads, property information, personal owned property information, use of financial calculators and/or the contents thereof and/or any other information obtained on the Website.</li>\r\n<li>Whilst the Website has taken reasonable measures to ensure the integrity of the Website and its contents, no warranty, whether express or implied, is given that the Website will operate error-free or that any files, downloads or applications available via the Website are free of viruses, trojans, bombs, time-locks or any other data, code or harmful mechanisms which has the ability to corrupt or affect the operation of your system.</li>\r\n<li>In no event shall the Website, and/or any third party contributors of material to the Website be liable for any costs, expenses, losses and damages of any nature (whether direct, indirect, punitive, incidental, special or consequential) arising out of or in any way connected with your use of the Website, your inability to use the Website and/or the operational failure of the Website, and whether or not such costs, expenses, losses and damages are based on contract, delict, strict liability or otherwise.</li>\r\n<li>Insofar as the Website contains links to any other internet websites, you acknowledge and agree that the Website does not have control over any such website and the Website shall therefore not be liable in any way for the contents of any such linked website, nor for any costs, expenses, losses or damages of any nature whatsoever arising from your access and/or use of any such website.</li>\r\n</ul>\r\n<p><strong>Severability</strong></p>\r\n<ul>\r\n<li>These Terms &amp; Conditions constitute the entire agreement between the Website and you. Any failure by the Website to exercise or enforce any right or provision of these Terms &amp; Conditions shall in no way constitute a waiver of such right or provision.</li>\r\n<li>In the event that any term or condition is not fully enforceable or valid for any reason, such term(s) or condition(s) shall be severable from the remaining terms and conditions. The remaining terms and conditions shall not be affected by such unenforceability or invalidity and shall remain enforceable and applicable.</li>\r\n</ul>\r\n<p><strong>Applicable Law</strong></p>\r\n<p>This Website is hosted outside of Philippines and controlled, managed in the Philippines, and thus, Philippine law and jurisdiction govern the use or inability to use this Website, or any other matter related to this Website.</p>\r\n<p><strong>Disputes</strong></p>\r\n<p>All disputes in terms of this agreement or relating to the use or inability to use this Website shall be settled by arbitration conducted in English in terms of the rules of the Philippines Republican Act.</p>', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi efficitur condimentum diam, dictum dapibus felis scelerisque sed. Aliquam sed sem eros. Aenean eu dui leo. Vivamus vitae metus orci. Phasellus consequat eu tellus sed imperdiet. Nam eget massa quis enim lacinia porta vitae quis eros. Integer dictum ornare sem efficitur tristique. Quisque sit amet risus massa. In hac habitasse platea dictumst.</p>\r\n<p>Aliquam convallis, nisl vel tempus dictum, dui ex ultricies odio, id accumsan ligula ex at arcu. Aliquam feugiat volutpat orci quis ultricies. Sed faucibus odio diam, sed rhoncus dolor suscipit id. Donec ac odio euismod, porttitor lorem eget, aliquet libero. Donec ac mattis lorem. Fusce tempor est eros, eget consectetur nulla mattis nec. Fusce dignissim ex in tempor interdum. Nullam egestas ac mauris sed auctor. Donec fringilla consectetur interdum. Morbi lacinia sagittis neque. In in leo tincidunt, imperdiet enim facilisis, consectetur nunc. Curabitur tellus dui, blandit et velit maximus, congue sollicitudin augue.</p>', '<p>refund policy</p>', 1713622343);
